INSERT INTO `brands` (`id`, `category_id`, `brand_name`, `category_slug`, `description`, `brand_logo`, `status`) VALUES
(1, 0, 'Hp', '[\"electronics\",\"computing\",\"home-office\"]', 'Whether you own a small business, manage a busy branch location, or run a large department, you can count on HP for dependable, cost-effective printers to meet your needs.', '', 1),
(2, 0, 'Zinox', '[\"computing\"]', 'Zinox is the foremost company to go into the uncharted terrain of Computer production and ICT solutions in West Africa and has etched its name into the world IT history books by notching a lot of firsts. These include but not limited to, the first internationally certified indigenous computer brand in West Africa, the first computer brand in the world to incorporate the Naira sign (N) on its keyboard, the first metropolitan WIMAX solution in Nigeria, among a host of others.', 'ygpg79idolfrt8udxrfz.png', 1),
(3, 0, 'Samsung', '[\"electronics\",\"computing\",\"home-office\"]', 'Samsung is a South Korean multinational conglomerate headquartered in Samsung Town, Seoul. It comprises numerous affiliated businesses, most of them united under the Samsung brand, and is the largest South Korean chaebol. Samsung was founded by Lee Byung-chul in 1938 as a trading company.', '', 1),
(4, 0, 'Epson', '[\"electronics\",\"computing\",\"home-office\"]', 'Seiko Epson Corporation, or simply Epson, is a Japanese electronics company and one of the world\'s largest manufacturers of computer printers, and information and imaging related equipment.', '', 1),
(5, 0, 'IBM', '[\"computing\"]', 'nternational Business Machines Corporation (IBM) is an American multinational information technology company headquartered in Armonk, New York, with operations in over 170 countries. The company began in 1911, founded in Endicott, New York, as the Computing-Tabulating-Recording Company (CTR) and was renamed \"International Business Machines\" in 1924.', 'typq66962gka8hiiixeo.jpg', 1),
(6, 0, 'DellEmc', '[\"electronics\",\"computing\"]', 'Dell EMC is an American multinational corporation headquartered in Hopkinton, Massachusetts, United States. Dell EMC sells data storage, information security, virtualization, analytics, cloud computing and other products and services that enable organizations to store, manage, protect, and analyze data', '', 1),
(8, 0, 'kaspersky', '[\"electronics\",\"computing\"]', 'Kaspersky Lab is a multinational cybersecurity and anti-virus provider headquartered in Moscow, Russia and operated by a holding company in the United Kingdom. It was founded in 1997 by Eugene Kaspersky, Natalya Kaspersky, and Alexey De-Monderik; Eugene Kaspersky is currently the CEO.', '', 1),
(9, 0, 'Philip', '[\"computing\"]', 'Koninklijke Philips N.V. (literally Royal Philips, stylized as PHILIPS) is a Dutch multinational technology company headquartered in Amsterdam, one of the largest electronics companies in the world, currently focused in the area of healthcare and lighting.', 'vftfim4blmc96dxhfly8.png', 1),
(10, 0, 'Microsoft', '[\"computing\"]', 'Microsoft Corporation (MS) is an American multinational technology company with headquarters in Redmond, Washington. It develops, manufactures, licenses, supports and sells computer software, consumer electronics, personal computers, and related services.', 'n6wiuejxjzf75cbzemwh.webp', 1),
(11, 0, 'D link', '[\"electronics\",\"computing\",\"home-office\"]', 'D-Link Corporation is a Taiwanese multinational networking equipment manufacturing corporation headquartered in Taipei, Taiwan. It was founded in March 1986 in Taipei as Datex Systems Inc.', '', 1),
(12, 0, 'Transcend', '[\"computing\"]', 'Transcend Information, Inc. (Chinese: ??????????; pinyin: Chuàngjiàn Z?xùn G?fèn Y?uxiàn G?ngs?) is a Taiwanese company headquartered in Taipei, Taiwan that manufactures and distributes memory products.', '', 1),
(13, 0, 'Cisco', '[\"electronics\",\"computing\",\"home-office\"]', 'Cisco Systems, Inc. is an American multinational technology conglomerate headquartered in San Jose, California, in the center of Silicon Valley, that develops, manufactures and sells networking hardware, telecommunications equipment and other high-technology services and products.', '', 1),
(14, 0, 'Canon', '[\"electronics\",\"home-office\"]', 'Canon Inc. is a Japanese multinational corporation specializing in the manufacture of imaging and optical products, including cameras, camcorders, photocopiers, steppers, computer printers and medical equipment. It\'s headquartered in ?ta, Tokyo, Japan.', 'rwugg1rs6r5o1xefuei2.png', 1),
(15, 0, 'Nokia', '[\"electronics\",\"computing\",\"home-office\"]', 'Nokia Corporation is a Finnish multinational telecommunications, information technology, and consumer electronics company, founded in 1865. Nokia\'s headquarters are in Espoo, in the greater Helsinki metropolitan area.', '', 1),
(16, 0, 'Tecno', '[\"computing\"]', 'Tecno Mobile is a Chinese mobile phone manufacturer which is based in Hong Kong. It was established in 2006. It is a subsidiary of Transsion Holdings.', '', 1),
(17, 0, 'Emerson', '[\"electronics\",\"computing\",\"home-office\"]', 'The Emerson Electric Co. is an American multinational corporation headquartered in Ferguson, Missouri, United States. This Fortune 500 company manufactures products and provides engineering services for a wide range of industrial, commercial, and consumer markets', '', 1),
(18, 0, 'Infinix', '[\"computing\"]', 'Infinix Mobile is a Hong Kong-based smartphone manufacturer founded in 2012 by Transsion Holdings.[1]. The company has research and development centres in China and designs its phones in France.', 'nbnqznwp0xkucdhqhit1.webp', 1),
(19, 0, 'Xtouch', '[\"electronics\",\"computing\",\"home-office\"]', 'XTouch Technologies is a leading technology company headquartered in UAE, providing high-quality and innovative mobility products that are value for money. \r\n\r\nStarted in 2012, XTouch has established its sales network over 20 countries across Middle East, Africa and in parts of Europe. \r\n\r\nXTouch\'s mission is to provide access to better life for consumer and to bring the latest advances in technology to the masses at an affordable price. \r\n\r\nWith the belief of Beyond Expectation, XTouch is and will be consistent from the first to last for delivering better-valued products and services to customer than ever expected.', '', 1),
(20, 0, 'Huawei', '[\"electronics\",\"computing\",\"home-office\"]', 'Huawei Technologies Co., Ltd. is a Chinese multinational telecommunications equipment and consumer electronics manufacturer, headquartered in Shenzhen. Ren Zhengfei, a former military engineer in the People\'s Liberation Army, founded Huawei in 1987.', '', 1),
(21, 0, 'hewlett packard', '[\"electronics\",\"computing\",\"home-office\"]', 'The Hewlett-Packard Company or Hewlett-Packard was an American multinational information technology company headquartered in Palo Alto, California.', '', 1),
(22, 0, 'iPower', '[\"computing\"]', 'IPOWER has seen tremendous growth, at one point being named to the Inc. 500 list, fueled both by word of mouth and by a competitive affiliate program. More than 1,000,000 customers from more than 100 countries depend on out platform every day for speed, reliability, security and global reach.', 'enqrur5dw0jrcqtx1rw0.jpg', 1),
(23, 0, 'APC', '[\"computing\"]', 'Providing design, specification & technical sales of electronic components, systems, lighting technologies & IoT products, with outstanding technical support.', 'aurzknmx384h0a8brtnm.jpg', 1),
(24, 0, 'Lenovo', '[\"computing\"]', 'Lenovo Group Ltd. or Lenovo PC International, often shortened to Lenovo  is a Chinese multinational technology company with headquarters in Beijing, China, and Morrisville, North Carolina, United States', 'bj6osdiqntyne40ikrzv.png', 1),
(25, 0, 'Hikvision', '[\"electronics\"]', 'Hikvision advances the core technologies of audio and video encoding, video image processing, and related data storage, as well as forward-looking technologies such as cloud computing, big data, and deep learning.', 'zbkvqqnf4i25man8fopi.png', 1),
(26, 0, 'Teclast', '[\"computing\"]', 'Teclast', 'jvpg0oxyb8q1wdrre6yg.webp', 0),
(27, 0, 'fashion', '[\"fashion\"]', 'fashion lace panties. A set of 12', '', 0),
(28, 0, 'SHANGHAO', '[\"computing\"]', 'SHANGHAO A6G4 All-in-one Computer\r\nWatch movies, edit photos and view documents easily with this high-performance all-in-one computer, which features a gorgeous 23.8 inch FHD display. Powerful Intel processor, super fast graphics, huge hard disk storage and more, all of this can maximize your complete personal entertainment and work. Get Shanghao products on onitshamarket.com', 'esaw7ezpqvs9xowyzqwp.webp', 1),
(29, 0, 'Apple', '[\"phones-tablets\",\"computing\"]', 'Apple Inc. is an American multinational technology company headquartered in Cupertino, California, that designs, develops, and sells consumer electronics, computer software, and online services. It is considered one of the Big Four of technology along with Amazon, Google, and Facebook', 'rh074b6son8d50zjqfau.jpg', 1),
(30, 0, 'Royal', '[\"electronics\",\"home-office\"]', 'Royal is a brand recognized as a leading home appliance brand,? providing top range solutions at the best prices. Customer’s delight is the focus of all the activities around brand Royal. Innovation represents Royals core value along with value for money, durability, and awesome after sales services. It requires creativity. This is why, Royal appliances are specially designed to meet customer demands, by combining innovation, technology, and design.', 'olpyst3gvzfn5alo2lzz.png', 1);
