(1, '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span style=\"font-size:20.0pt;mso-bidi-font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#00B050\">Registration Agreement<o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">BEFORE YOU COMPLETE THE\r\nREGISTRATION PROCESS AND BECOME OUR REGISTERED BUYER, PLEASE READ THE FOLLOWING\r\nTERMS CAREFULLY. IF YOU DO NOT ACCEPT ALL OF THE REGISTRATION AGREEMENT, PLEASE\r\nDO NOT CLICK ‘’CREATE MY ACCOUNT” BUTTON.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:14.0pt;mso-bidi-font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#00B050\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:14.0pt;mso-bidi-font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#00B050\">Introduction<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Welcome\r\nto Onitshamarket.com, your reliable online marketplace.<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">The web site identified by\r\nthe uniform resource locator www.onitshamarket.com (the “Site”) is provided by\r\nInternet Onitshamarket Limited (“Onitshamarket.com”) as a service to our customers.&nbsp; <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">This Registration Agreement\r\n(referred to throughout this site as \"the Agreement\") is entered into\r\nbetween you as the registered user of the site (the “the Registered User or\r\nUser”) and Onitshamarket.com.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Please review the following\r\nbasic rules that govern your use and access on the site. Please also note that\r\nyour click of “Create My Account” button constitutes your unconditional\r\nagreement to follow and be bound by this Agreement. If you do not accept all of\r\nthe terms of this Agreement, please do not click the “Accept the Agreement”\r\nbutton.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.\r\nApplication of Registration Agreement<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.1 For your registration\r\nand purchase on the Site, you should accept this Agreement, the Terms of Use,\r\nthe terms and conditions related to them and the Security and Privacy policy of\r\nOnitshamarket.com. Meanwhile, during your purchase and transaction process on\r\nthe Site, certain Membership Agreement and related terms and conditions between\r\nyou as a Registered User and Onitshamarket.com will bind. Therefore, besides this\r\nAgreement, we recommend you to read those relative terms, conditions and\r\ninformation carefully. Additionally, your acceptance of this Agreement also\r\nmeans that the aforesaid relative terms, conditions and the Security and\r\nPrivacy policy of Onitshamarket.com will apply to your purchase and transaction\r\nprocess on the Site.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.2 Terms has not been\r\ndefined or stipulated in this Agreement shall be interpreted in accordance with\r\nthe definition(s) or provision(s) of the Terms of use of Onitshamarket.com.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.3 Except as explicitly\r\nstated otherwise, the registration, services, functions and features on the\r\nSite is free of charge for our Registered Users, however, Onitshamarket.com\r\nreserves the right to charge them in the future for whatever reason.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.4 After your registration,\r\nyou will get a unique Account ID and Password from Onitshamarket.com and the\r\nSite. Each Use shall take responsibility solely for the transaction outcome\r\noccurred under this Account ID and Password, and for the confidentiality of\r\nyour Account ID and Password. You should use this Account ID and Password\r\nalone, and, without prior written consent from Onitshamarket.com, you should\r\nnot transfer your Account ID and Password to others for any use.\r\nOnitshamarket.com shall never take responsibility for any loss or damages\r\nrelated to your incorrect use or transfer of the Account ID or Password.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.5 In its sole discretion,\r\nOnitshamarket.com may suspend or terminate any account, part of function and\r\nservice of any account, for whatever reason, including but not limited to, any\r\ndelay of payment delivery, breach of contract, infringement of third party\r\nrights, or creating any liability for the Site or Onitshamarket.com.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.6 Please also note that\r\nthe services, functions and features from the Site that the registered user may\r\nenjoy may differ with the country or region you are living or transacting, and\r\ncertain functions and services on the Site may require special verification or\r\nbe preserved for paying members only.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.\r\nThe purchase on the Site<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.1 You must be registered\r\non the Site in order to make purchases on the Site and/or access some Services.\r\nYour status as a Registered User and the purchase process are governed by the\r\nAgreement and any terms and conditions related thereto. Onitshamarket.com may\r\nreject a User’s application for registration for any reason. Upon registration\r\non the Site, Onitshamarket.com shall assign an account (the “Onitshamarket.com\r\nAccount ID”) and a password (the “Password”) to each Registered User.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.2 Each User will be\r\nrequired to provide information or material about your entity, business or\r\nproducts/services as part of the registration process on the Site or your use\r\nof any Service or the Onitshamarket.com account. Each User represents, warrants\r\nand agrees that (a) such information and material, whether submitted during the\r\nregistration process or thereafter throughout the continuation of the use of\r\nthe Site or Service, is true, accurate, current and complete, and (b) you will\r\nmaintain and promptly amend all information and material to keep it true,\r\naccurate, current and complete.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.3 By confirming your\r\npurchase at the end of the checkout process, you agree to accept and pay for\r\nthe item(s) purchased. You realize that any delay in the process of delivery\r\npayment may constitute a contract breach, and you shall be solely responsible\r\nfor such breach.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.4 Each User understands\r\nand accepts that the price listed for the product on the Site and/or the price\r\npaid for the product includes the commission due to Onitshamarket.com.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.5 You understand that by\r\nusing and accessing the Site or any Services provided on the Site, you may\r\nencounter content that may be deemed by some to be offensive, indecent, or\r\nobjectionable, which content may or may not be identified as such. You agree to\r\nuse the Site and any Service at your sole risk, and that Onitshamarket.com\r\nshall have no liability to you for Content that may be deemed to be offensive,\r\nindecent, or objectionable.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.6 Each User understands\r\nand accepts that the product and content listing or displaying on the Site may\r\nrelate to copyrights, trademarks, trade secrets, patents and other personal or\r\nproprietary rights of a third party. Further, each User agrees that the User\r\nwho uploads or lists that content and information on the Site shall be solely\r\nresponsible for any violation of third party rights. The Site and\r\nOnitshamarket.com shall not be liable for any infringement or purchase dispute\r\nrelated to the intellectual property and/or other personal or proprietary\r\nrights of third party.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.7 When required by the\r\ngovernment, law enforcement body, or oblige whose legitimate right has been\r\ninjured, or forced by subpoena or other legal document, Onitshamarket.com may\r\ndisclose the User’s identity and contact information. User agrees not to bring\r\nany action or claim against Onitshamarket.com for such disclosure.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">3.\r\nTransactions between Buyers and Sellers<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">3.1 Each Registered User\r\nunderstands and agrees that Onitshamarket.com is not a traditional seller or\r\nmart. Throughout the Site, what Onitshamarket.com provides is only an online\r\nplatform or venue for information exchange and transaction between buyers and\r\nsellers. Although Onitshamarket.com will monitor the regular operation of the\r\nSite to fulfill the duty of care, Onitshamarket.com does not review and check\r\neach posted content and listing to search for the infringement and illegal\r\nactivity. Besides, due to the limitation of current technology, searching for\r\nthe infringement and illegal activity in our Site is beyond our competence and\r\ncapability.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">3.2 Despite this Agreement,\r\nthe terms and conditions linked to this Agreement, Security and Privacy policy\r\nof Onitshamarket.com and other terms and conditions throughout the Site, no\r\nagency relationship will be created between Onitshamarket.com and the seller or\r\nbuyer concerning the listing and transaction, whether or not such transactions\r\nare entered into via the Site.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">3.3 Registered Users hereby\r\nacknowledges that although Onitshamarket.com tries its best to provide the\r\nusers with accurate information and listing posted by sellers, and do general\r\nverifications about the identity of the sellers, there still may be risks of\r\npurchasing with people online. Therefore, we encourage you, the registered\r\nuser, to use relevant tools available, reasonable judgment, as well as common\r\nsense, to make the deal online.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">3.4 In no event shall\r\nOnitshamarket.com be responsible for any infringement or transaction dispute,\r\nincluding, but not limited to, transaction disputes about quality, safety,\r\nbreach of warranty, lawfulness or availability of the products or services and\r\nthe payment from buyers, as well as any intellectual property infringement by\r\nsellers.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">3.5 The users (including the\r\nseller and buyer) agree to release and indemnify Onitshamarket.com and its\r\nagents, affiliates, directors, officers and employees from all claims, demands,\r\nactions, proceedings, costs, expenses and damages (including, but not limited\r\nto, any actual, special, incidental or consequential damages) arising out of or\r\nin connection with any transactional dispute about the products, listing, or\r\ninformation on the Site.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">3.6 In order to help the\r\nsellers and the Registered Users solve and settle any transactional disputes\r\neffectively and efficiently, Onitshamarket.com has established the “Handling\r\nProcedures for Transactional Dispute”.&nbsp;\r\nHere, the sellers and Registered Users shall agree that when the\r\nRegistered Users file the transactional disputes with Onitshamarket.com, the\r\nsellers and the Registered Users should comply with the “Handling Procedures\r\nfor Transactional Dispute”, and permit Onitshamarket.com to make a final\r\nbinding decision regarding the dispute.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">4.\r\nLimitation of Liability<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">4.1 To the maximum extent\r\npermitted by law, this Site is provided by Onitshamarket.com on an “as is”, “as\r\navailable” and “with all facts” basis. Onitshamarket.com makes no\r\nrepresentations or warranties of any kind, express or implied, as to the\r\noperation of the Site or the information, content, materials, or products\r\nincluded on this Site. To the full extent permissible by applicable law,\r\nOnitshamarket.com hereby expressly disclaims any and all warranties, express or\r\nimplied, including, but not limited to, any warranties of condition, quality,\r\ndurability, performance, accuracy, reliability, non-infringement,\r\nmerchantability or fitness for a particular purpose. Without limiting the\r\nforegoing, Onitshamarket.com disclaims any and all warranties, express or\r\nimplied, for any merchandise offered on this Site. All such warranties,\r\nrepresentations, conditions and undertakings are hereby excluded. You acknowledge,\r\nby your use or access of the Site, that your use or access of the site is at\r\nyour sole risk. This disclaimer does not apply to any product warranty offered\r\nby the manufacturer of the item. This disclaimer constitutes an essential part\r\nof this Agreement.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">4.2 Under no circumstances\r\nand under no legal or equitable theory, whether in tort, contract, strict\r\nliability or otherwise, shall Onitshamarket.com or any of its affiliates,\r\nemployees, directors, officers, agents, vendors or suppliers be liable to you\r\nor to any other person for any indirect, special, incidental or consequential\r\nlosses or damages of any nature arising out of or in connection with the use of\r\nor inability to use the Site, including, without limitation, damages for lost\r\nprofits, loss of goodwill, loss of data, work stoppage, accuracy of results, or\r\ncomputer failure or malfunction, even if an authorized representative of\r\nOnitshamarket.com has been advised of or should have known of the possibility\r\nof such damages.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">4.3 In addition, in no event\r\nshall Onitshamarket.com be liable for damages stemming from any one of the\r\nfollowing, no matter it is special, direct, indirect, punitive, incidental or\r\nconsequential damages, or related to contract, negligence, tort or otherwise:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">a) Any disputes related to\r\ngoods, services, or information purchased or obtained from a seller or a\r\nthird-party via the Site, including, but not limited to, disputes about\r\nquality, safety, warranty, lawfulness or availability of such goods, services\r\nor information;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">b) Any violation of Third\r\nParty Rights on the Site;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">c) Unauthorized access to\r\ndata or private information of any User on the Site; or<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">d) Statements or conducts of\r\nany User of the Site.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">4.4 Notwithstanding any of\r\nthe foregoing provisions, if Onitshamarket.com, our employees, agents,\r\naffiliates, representatives or anyone acting on our behalf is found to be\r\nliable, our liability will not exceed the commissions paid by you in connection\r\nwith your use of the Site during the three month period preceding the date on\r\nwhich the claim arose.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">5.\r\nIndemnification<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">You agree to defend,\r\nindemnify and hold Onitshamarket.com and its affiliate, directors, officers and\r\nemployees harmless from and against any and all losses, claims, liabilities,\r\ndamages, costs and expenses, including attorneys’ fees, arising from or related\r\nto (1) your use of the Site, (2) your breach of any representations and/or\r\nwarranties made by you to Onitshamarket.com and (3) claims asserted by third\r\nparty rights claimants or other third parties relating to products offered or\r\ndisplayed on the Site.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">6.\r\nTermination<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">The Agreement is effective\r\nunless and until terminated by either you or Onitshamarket.com. You may\r\nterminate this Agreement at any time, provided that you discontinue any further\r\nuse of this Site. Onitshamarket.com also may terminate this Agreement at any\r\ntime and may do so immediately without notice, and accordingly deny you access\r\nto the Site, if in Onitshamarket.com’s sole discretion you fail to comply with\r\nany term or provision of this Agreement. Upon any termination of the Agreement\r\nby either you or Onitshamarket.com, you must promptly destroy all materials\r\ndownloaded or otherwise obtained from this Site, as well as all copies of such\r\nmaterials, whether made under the Terms of Use or otherwise. Onitshamarket.com’s\r\nright to any Contents, and the provisions of Sections 2, 3, 4, 5, 7, and 8,\r\nshall survive any termination of this Agreement.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">7.\r\nNotice<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">7.1 Except as explicitly\r\nstated otherwise, all notice or demand to or upon Onitshamarket.com shall be in\r\nwriting and delivered to Onitshamarket.com by mail to the following\r\naddress:eCommerce Store, Onitsha Main Market<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Onitsha, Anambra State,\r\nAttn: Legal Department. Notice shall be deemed effective when received by\r\nOnitshamarket.com in any of the above-mentioned manner.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">7.2 All notices or demands\r\nto or upon a User shall be effective if delivered personally, by e-mail to the\r\ne-mail address provided to Onitshamarket.com during the registration process\r\n(as updated from time to time, if applicable), or by posting such notice or\r\ndemand on an area of the Site that is publicly accessible without a charge.\r\nNotice to a User shall be deemed to be received by such User if and when: (1)\r\nOnitshamarket.com is able to demonstrate that communication, whether in\r\nphysical or electronic form, has been sent to such User, or (2) immediately\r\nupon Onitshamarket.com posting such notice on an area of the Site that is\r\npublicly accessible without charge.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">7.3 You agree that all\r\nagreements, notices, demands, disclosures and other communications that\r\nOnitshamarket.com sends to you electronically satisfy the legal requirement\r\nthat such communication should be in writing.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">8.\r\nGeneral<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">8.1 Onitshamarket.com\r\nreserves the right to update or modify this Registration Agreement at any time\r\nwithout prior notice to you. Your use of the Site following any such change\r\nconstitutes your unconditional agreement to follow and be bound by the\r\nRegistration Agreement as changes.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">8.2 Headings used in the\r\nAgreement are for reference purposes only and in no way define or limit the\r\nscope of the section.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">8.3 If any provision of this\r\nAgreement is held to be unenforceable for any reason, such provision shall be\r\ndeleted or reformed to the extent necessary to make it enforceable and the\r\nother terms of this Agreement shall remain in full force and effect.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">8.4 The failure of\r\nOnitshamarket.com to act with respect to a breach of this Agreement by you or others\r\ndoes not constitute a waiver and shall not limit Onitshamarket.com’s rights\r\nwith respect to such breach or any subsequent breaches.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">8.5 Any action or proceeding\r\narising out of or related to this Agreement or your use of this Site must be\r\nsubmitted to the Nigerian international Economic and Trade Arbitration\r\nCommission for arbitration which shall be conducted in accordance with the\r\nCommission’s arbitration rules in effect at the time of the application for\r\narbitration. The arbitral award shall be final and binding upon both parties.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">8.6 This Agreement shall be\r\ngoverned by and construed under the laws of Nigeria without regard to conflict\r\nof law provisions.<o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"margin-left:-.25in;text-align:center\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">8.7 If there is any conflict\r\nbetween the English version and another language version of this Agreement, the\r\nEnglish version shall prevail.<o:p></o:p></span></p>', 'agreement', '2019-03-12 14:23:43');
