(2, '<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:-.25in;text-align:center\"><b><span style=\"font-size:20.0pt;mso-bidi-font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#00B050\">Terms\r\nof Use<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">BEFORE YOU USE OR ACCESS OUR\r\nWEBSITE, PLEASE READ THE FOLLOWING TERMS OF USE CAREFULLY. IF YOU DO NOT ACCEPT\r\nALL OF THE TERMS OF USE, PLEASE DO NOT USE OR ACCESS OUR WEBSITE.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:14.0pt;mso-bidi-font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#00B050\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:14.0pt;mso-bidi-font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#00B050\">Introduction<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><br></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Welcome\r\nto Onitshamarket.com, your reliable online marketplace.<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Internet Onitshamarketing\r\nLimited is a registered company in Nigeria with registration number: <i>RC 1247532, </i>trading online with the\r\nwebsite identified by the uniform resource locator (URL): www.onitshamarket.com\r\n(the “Site”). The company is an online eCommerce platform for buyers and\r\nsellers. The Terms of Use describe the terms and conditions applicable to your\r\naccess and use of the Site. This document is a legally binding agreement (the\r\n“Agreement”) between you as the user(s) of the Site (referred to as “you”,\r\n“your” or “User” hereinafter) and www.onitshamarket.com.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Please review the following\r\nbasic rules that govern your use and access of the Site (the “Agreement”).\r\nPlease also note that your use or access of the Site constitutes your\r\nunconditional agreement to follow and be bound by this Agreement, although you\r\nmay “bookmark” a particular portion of this Site and thereby bypass this\r\nAgreement. If you do not accept all of the terms of this Agreement, please do\r\nnot use or access the Site.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">This Agreement is effective\r\non March 1, 2019 for current users, and immediately upon acceptance by new\r\nusers.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.\r\nApplication of Terms of Use<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.1 Your use and access of\r\nthe Site and its services, software and products (collectively, the “Services”)\r\nare governed by all terms and conditions related to this Agreement as well as\r\nthe <a href=\"https://www.onitshamarket.com/page/policy/\" target=\"_blank\">Privacy Policy</a>, the Intellectual Property Rights Policy, and\r\nany other rules and policies of the Site that Onitshamarket.com may publish\r\nfrom time to time. This Agreement and such other rules and policies of the Site\r\nare collectively referred to herein as the “Terms”. Meanwhile, with regard to\r\nyour purchases and transactions on the Site, the <span style=\"color:#548DD4;\r\nmso-themecolor:text2;mso-themetint:153\"><a href=\"https://www.onitshamarket.com/page/agreement/\" target=\"_blank\">Registration Agreement</a></span> and\r\nrelated terms and conditions between you as a buyer or seller and\r\nOnitshamarket.com will be binding upon you. Therefore, we recommend that you\r\nread this Agreement and all relevant additional terms, conditions and\r\ninformation, including, but not limited to, the <span style=\"color:#548DD4;\r\nmso-themecolor:text2;mso-themetint:153\"><a href=\"https://www.onitshamarket.com/page/agreement/\" target=\"_blank\">Registration</a></span><a href=\"https://www.onitshamarket.com/page/agreement/\" target=\"_blank\"> </a><span style=\"color:#548DD4;mso-themecolor:text2;mso-themetint:153\"><a href=\"https://www.onitshamarket.com/page/agreement/\" target=\"_blank\">Agreement</a></span>,\r\nthe <span style=\"color:#548DD4;mso-themecolor:text2;mso-themetint:153\"><a href=\"https://www.onitshamarket.com/page/policy/\" target=\"_blank\">Privacy Policy</a></span>\r\nand the Intellectual Property Rights Policy, carefully.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.2 Please be advised that\r\nyour use and/or access to the Site are also subject to any terms and conditions\r\napplicable to certain specific Member Services (defined below). In the event of\r\nany conflict or inconsistency between the aforesaid terms, conditions and\r\ninformation and the terms and conditions applicable to that specific Member\r\nService, the terms and conditions applicable to the specific Member Service\r\nshall prevail.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.3 Member Services means a\r\ncertain feature or function that Onitshamarket.com reserves for only certain\r\npaying Users, who undergo a specific registration or verification process. The\r\ncontents and fee structure of such Member Services shall be determined by\r\nOnitshamarket.com independently and reported to the applicable Users from time\r\nto time and at any time through a notice posted on the Site, email or other\r\nmeans.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.4 You acknowledge and\r\nagree that Onitshamarket.com may amend any Terms at any time by posting the\r\nrelevant amended and restated Terms on the Site. By continuing to use the\r\nServices or the Site, you agree that the amended Terms apply to you.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.5 If Onitshamarket.com has\r\nposted or provided a translation of the English language version of the Terms,\r\nyou agree that the translation is provided for convenience only and that the\r\nEnglish language version will govern your use of the Services or the Site.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">1.6 The Terms may not\r\notherwise be modified except in writing by an authorized officer of\r\nOnitshamarket.com.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.\r\nThe Use of the Site<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.1 By accepting these Terms\r\nof Use through your use or access of the Site, you represent that you are (a) a\r\nperson of legal age and able to form a legally binding contract in the\r\njurisdiction in which you are a resident and from which you use the Services,\r\nand (b) permitted to receive any Services under the laws of the jurisdiction in\r\nwhich you are a resident and from which you use the Services. If you do not\r\nagree to (or cannot comply with) this Section 2.1, do not use this Site.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.2 All billing and\r\nregistration information provided on the Site must be truthful and accurate.\r\nEach User shall be solely responsible for the information and content posted on\r\nthe Site. Providing untruthful or inaccurate information constitutes a breach\r\nof these Terms of Use.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.3 All materials, including\r\nimages, text, illustrations, designs, icons, photographs, program