ce(s) of any User for any reason whatsoever, including, but not\r\nlimited to, infringing any third party’s intellectual property right, breaching\r\nthis Agreement, and incurring any liability to Onitshamarket.com. Each User\r\nhereby also agrees that in no event shall Onitshamarket.com be liable to any\r\nUser or any third party for any User’s inability to use or access the Site\r\nand/or Services.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.7 Onitshamarket.com may\r\nlaunch, change, upgrade, impose conditions to, suspend, or stop any Services\r\n(or any feature within the Services) without prior notice, except that, in the\r\ncase of a fee-based Service, such changes shall not substantially adversely\r\naffect the paying Users enjoying that Service.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">2.8 Some Services may be\r\nprovided by Onitshamarket.com’s affiliates on behalf of Onitshamarket.com.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">3.\r\nPurchasing on the Site<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">3.1 You must be registered\r\non the Site (a “Registered User”) in order to make purchases on the Site and/or\r\naccess some Services. Your status as a Registered User and the purchase process\r\nare governed by the <span style=\"colo