amarket.com immediately if you become aware of any unauthorized use of\r\nyour password or your account or any other breach of security of your\r\nOnitshamarket.com Account.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">3.4 User agrees that all\r\nactivities that occur under your Onitshamarket.com Account (including, without\r\nlimitation, posting any company or product information, clicking to accept any\r\nadditional agreements or rules, subscribing to or making any payment for any\r\nservices, sending e-mails using the latest e-mail account or sending SMS) will\r\nbe deemed to have been authorized by you.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">3.5 User acknowledges that\r\nsharing your account with other persons, or allowing multiple users outside of\r\nyour business entity to use your account (collectively, “multiple use”), may\r\ncause irreparable harm to Onitshamarket.com or other Users of the Site. User\r\nshall indemnify Onitshamarket.com, our affiliates, directors, employees, agents\r\nand representatives against any loss or damage (including but not limited to\r\nloss of profits) suffered as a result of the multiple use of your account. User\r\nalso agrees that in the case of the multiple use of your account or User’s\r\nfailure to maintain the security of your account, Onitshamarket.com shall not\r\nbe liable for any loss or damages arising from such a breach and shall have the\r\nright to suspend or terminate User’s Onitshamarket.com Account without\r\nliability to User.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">3.6 By confirming your\r\npurchase at