.com is not a traditional seller or mart. Through\r\nthe Site, what Onitshamarket.com provides is only an online platform or venue\r\nfor information exchange and transaction between buyers and sellers, including\r\nelectronic web-based transaction platforms for Users to place, accept,\r\nconclude, manage and fulfill orders for the provision of products and services\r\nonline subject to the <span style=\"color:#548DD4;mso-themecolor:text2;\r\nmso-themetint:153\"><a href=\"https://www.onitshamarket.com/page/agreement/\" target=\"_blank\">Registration Agreement</a></span>. Although Onitshamarket.com\r\nwill monitor the regular operation of the Site to fulfill its duty of care,\r\nOnitshamarket.com does not review and check each item of posted content and\r\nlisting to search for infringement or illegal activity.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">4.2 Despite the Terms, no\r\nagency relationship will be created between Onitshamarket.com and any seller or\r\nbuyer concerning the listing and transaction, whether or not such transactions are\r\nentered into via the Site.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">4.3 User hereby acknowledges\r\nthat although Onitshamarket.com tries its best to provide Users with accurate\r\ninformation and listings posted by sellers, and do general verifications of the\r\nidentity of sellers, there are still risks associated with purchasing from\r\nparties online. Therefore, we encourage you, the users of the Site, to use\r\nrelevant tools available, reasonable judgment and common sense when making a\r\ndeal online.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial