(3, '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span style=\"font-size:20.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#00B050\">Privacy Policy<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:14.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#00B050\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:14.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#00B050\">Welcome to\r\nOnitshamarket.com, your reliable online marketplace.<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">We,\r\nthe Internet Onitshamarketing Limited (Company)</span><span style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"> trading online with\r\nthe uniform resource locator (URL): www.onitshamarket.com</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">, take your personal information\r\nseriously and use or keep it confidential. In order to protect your private\r\ninformation, we have established this Privacy Policy (the \"Policy\")\r\nin accordance with best practices in the industry and applicable laws and\r\nregulations. This Policy describes how we handle your personal information for\r\nour services on the onitshamarket.com website and its related sites, services\r\nand tools (the \"Website\"). <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">By\r\naccepting the Policy and the User Agreement in registration, you expressly\r\nconsent to our collection, storage, use and disclosure of your personal\r\ninformation as described in this Policy. This Policy is effective on March 1,\r\n2019 for current users, and immediately upon acceptance by new users.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">This\r\nPrivacy Policy (the “Agreement” or “Policy”) is entered into between you as a\r\nregistered user of the site (“Registered User”) and Onitshamarket.com.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">The\r\nsecurity of your personal information is very important to us and we value your\r\ntrust highly. We will not sell or loan your personal information to a third\r\nparty under any circumstances. We will work hard to protect the security and\r\nprivacy of any personal information you provide to us and will only use such\r\ninformation as we have described herein. By your use and access of the Site,\r\nyou accept this Security and Privacy Policy. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">What personal information do we collect?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">You\r\nmay choose to use or access our Site without revealing any personal and\r\ntransactional information about yourself, but you will need to register and\r\ncreate an account in order to make a purchase or take advantage of certain\r\nfeatures and functions, including, but not limited to, “My Contacts”. If you\r\nprovide us with your information, you consent to the transfer and storage of\r\nthe information on our server located in United States of America (“USA.”).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">As\r\nset forth in more detail below, Onitshamarket.com collects personal information\r\nthat you provide when using the Site. This information includes your first and\r\nlast name, email address, a password and other information required when you\r\ncreate your Onitshamarket.com account or when you participate in or conduct\r\nsurveys and contests via the Site, email, or other media of Onitshamarket.com.\r\nIn order to protect your confidentiality and verify your identity, we may ask\r\nyou to confirm your personal information when you contact our Customer Service\r\nDepartment.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">In\r\naddition to the personal information we may collect and process during\r\nregistration and any surveys, we also collect, store and process the following\r\ninformation about our users:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:0in;mso-add-space:auto;text-align:\r\njustify;text-indent:0in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><b><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></b><!--[endif]--><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;\">Purchase Information<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">When\r\nyou make a purchase from Onitshamarket.com, we collect your name and payment\r\nmethod information. When you create an account at Onitshamarket.com, you can\r\nchoose to save your billing information in “My Profile.” You can also save one\r\nor more shipping addresses in your Onitshamarket.com Address Book.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:0in;mso-add-space:auto;text-align:\r\njustify;text-indent:0in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><b><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-weig