text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">When\r\nyou visit the Site, you will be assigned a permanent “cookie” (a small text\r\nfile) to be stored on your computer’s hard drive. The purpose of the cookie is\r\nto identify you when you visit the Site so that we can enhance and customize\r\nyour online purchasing experience.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">You\r\ncan choose to browse on the Site without cookies, but without these identifier\r\nfiles you will not be able to complete a purchase or take advantage of certain\r\nfeatures of the Site. These features include storing your shopping cart for\r\nlater use and providing a more personalized future shopping experience. Each\r\nbrowser is different, so check the “Help” menu of your browser to learn how to\r\nchange your cookie preferences.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">We\r\nalso collect certain technical information from your computer each time you\r\nrequest a page during a visit to the Site. This information may include your\r\nInternet Protocol (IP) address, your computer’s operating system, browser type\r\nand the address of a referring web site, if any. We collect this information to\r\nenhance the quality of your experience during your visit to the Site and will\r\nnot sell or loan this information to any third parties.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">We\r\nalso contract with third parties to provide us with data collection and\r\nreporting services regarding our customers’ activities on the Site and to track\r\nand measure the performance of our marketing efforts. These third parties may\r\nuse cookies and may receive anonymous information about your browsing and\r\nbuying activity on this Site. None of your personally identifiable information\r\n(such as your name, address, email address, etc.) will be received by or shared\r\nwith these third parties.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:0in;mso-add-space:auto;text-align:\r\njustify;text-indent:0in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><b><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial\">4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></b><!--[endif]--><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;\">Publishing Information<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">When\r\nyou submit any information on the Site during your use or access, including,\r\nbut not limited to, information on the Onitshamarket.com blog, the rating\r\nsystem, or product catalog, you are deemed to have given your permission to Onitshamarket.com\r\nto publish such information, and Onitshamarket.com and the Site hereby enjoy an\r\nirrevocable, worldwide and royalty-free, sub-licensable license to use all\r\ninformation provided by such user to exercise the copyright, compilation,\r\ndatabase and publicity rights any user has in such material or information, in\r\nany media form.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">How we use your personal information?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">We\r\ndo not sell, loan, trade or exchange any user’s personal information without\r\nsuch user’s consent. The information we collect on the Site may be used to\r\nenhance your shopping experience in the following ways:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><i><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Deliver merchandise and services that\r\nyou purchase online; Register you as a member of Onitshamarket.com; Prevent\r\nfraud; Confirm your orders; Resolve disputes and prevent prohibited and illegal\r\nactivities; Enforce our Terms of Use and related agreements; Respond to your\r\ncustomer-service inquiries or requests; Communicate great values and featured\r\nitems to you; Find and stock the products you want; and Customize, measure and\r\nimprove our services and your purchase experience. <o:p></o:p></span></i></p><p class=\"MsoNormal\" style=\"text-align:justify\"><i><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></i></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">When and with whom can we share your\r\npersonal information?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">We\r\ndo not sell or loan your personal information to any third parties under any\r\ncircumstances. We will share your personal customer information only with our\r\nagents, representatives, service providers, and contractors for limited\r\npurposes, including, but not limited to, fulfilling customer orders, offering\r\ncertain products and services in connection with the Site, communicating to\r\ncustomers, providing customer service, storing, sharing and retrieving\r\ncustomers’ photo images in our Photo Center, enhancing and improving clients’\r\npurchase experience, enabling access to our partners’ web sites, providing a\r\npersonalized purchase experience and preventing fraud and completing payment\r\nmethod processing.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Aside\r\nfrom the purposes described above, we will not share your personal information\r\nwith any other third parties unless we have your express permission or there\r\nare special circumstances, such as when Onitshamarket.com is required by the\r\ngovernment, law enforcement body, obligee whose legitimate right has been\r\ninjured, subpoena or other legal document to share such information, or if we\r\nbelieve it to be reasonably necessary to protect the safety of any person; to\r\naddress fraud, security or technical issues; or to protect Onitshamarket.com’s\r\nrights or property. We may also share aggregated demographic and statistical\r\ninformation with our partners. This is not linked to any personal information\r\nthat can identify any individual person.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">How can you control the use of your\r\npersonal information?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">You\r\ncan modify or delete your personal information at any time. Simply go to My\r\nAccount. Log in with your ID and password, then edit or delete your personal\r\ninformation at your discretion.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">How can we protect the security of your\r\npersonal information?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Your\r\npersonal information is protected by the password you created when you created\r\nan account on the Site (or another password you chose after changing a previous\r\npassword). Please keep this password confidential. No Customer Service\r\nAssociate or any other representative of Onitshamarket.com will ever ask you\r\nfor your password. The confidentiality of your password is yours to protect.\r\nYou may change it at anytime by going to My Account. Log in with your email\r\naddress and password, then click “Modify Details, Email &amp; Password” and\r\nenter a new password.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Minors<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Onitshamarket.com\r\ndoes not intentionally collect personal information about minors or other\r\npersons without full civil conduct capacity, but based on the properties of\r\nInternet, there is no way for Onitshamarket.com and the Site to distinguish the\r\nage or capacity of the users. By accepting this Agreement through your use or\r\naccess of the Site, you certify that you are a person over 18 years old with\r\nfull capacity and ability to form a legally binding contract in the\r\njurisdiction in which you are resident or in which you are entering into this\r\nAgreement. If you do not agree to (or cannot comply with) any of the terms of\r\nthis Agreement, do not use the Site.<b><o:p></o:p></b></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Meanwhile,\r\nif a minor or other person does not have full civil conduct capacity and has\r\nprovided personal information to us without the proper consent of their parent\r\nor legal guardian, such parent or legal guardian should contact us to remove\r\nsuch personal information.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Security<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Your\r\ninformation is stored on our servers located in the USA, and we adopt lots of\r\ntools, means and technologies to protect them against unauthorized access, use\r\nand disclosure. For instance, we use a technology called Secure Sockets Layer\r\n(SSL), which encrypts (or encodes) sensitive information before it is sent over\r\nthe Internet. However, we are limited in our efforts by the technologies\r\ncurrently available, and no data transmission or storage over Internet can be\r\nguaranteed to be perfectly safe. Therefore, although we work very hard to\r\nprotect your information and privacy, we do not promise or guarantee that your\r\ninformation will always be private and safe.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">General<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">We\r\nrealize that making purchases on the Site, or any other web site, requires\r\ntrust on your part. We value your trust very highly and pledge to you, our\r\nclients that we will work hard to protect the security and privacy of any\r\npersonal information you provide to us and that your personal information will\r\nonly be used as set forth in this Policy. This includes your name, address,\r\nphone number, email address or checking account information, in addition to any\r\nother personal information that can be linked to you, personally.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Onitshamarket.com\r\nmay provide links to certain third party web sites. This Security and Privacy\r\nPolicy applies only to activities conducted and personal information collected\r\non the Site. Other web sites may have their own policies regarding privacy and\r\nsecurity. We encourage you to review the privacy policies on these sites before\r\nyou use and access them. You are solely responsible for your use and access of\r\nother web sites.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Onitshamarket.com\r\nwill obtain your consent before allowing the download of any data from the\r\nSite, and Onitshamarket.com will not automatically download any data to your\r\ncomputer system. Once you consent to the initial download of any data, you may\r\nreceive automatic updates or patches pertaining to such software. You\r\nunderstand and agree that any material, including but not limited to downloaded\r\nsoftware, required or automated updates, modifications, reinstallations, or\r\nsoftware otherwise obtained through the use of the Site is done at your own\r\ndiscretion and risk and that you will be solely responsible for any damages to\r\nyour computer system or loss of data that may result from any such material.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Onitshamarket.com\r\nreserves the right to update or modify this Security and Privacy Policy at any\r\ntime without prior notice to you. If Onitshamarket.com makes a change that, in\r\nOnitshamarket.com’s sole discretion, is material, Onitshamarket.com will notify\r\nyou via e-mail to the email address associated with your account. Your use of\r\nthe Site following any such change constitutes your unconditional agreement to\r\nfollow and be bound by the Security and Privacy Policy as amended.\r\nOnitshamarket.com may transfer this Policy and all or part of its rights,\r\nobligations and interests to any party or entity in its sole discretion;\r\nhowever, a User may not assign its rights, obligations and interests under this\r\nPolicy to any party or entity.<o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Terms\r\nwhich have not been defined or stipulated in this Agreement shall be\r\ninterpreted in accordance with the definition(s) or provision(s) of the Terms\r\nof Use of Onitshamarket.com.<o:p></o:p></span></p>', 'privacy', '2019-03-13 11:05:59'),
(4, '<p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\ntext-align:center;line-height:normal;tab-stops:.5in;mso-layout-grid-align:none;\r\ntext-autospace:none\"><b><span style=\"font-size:22.0pt;mso-bidi-font-size:9.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\ncolor:#00B050\">Corporate Social Responsibility<o:p></o:p></span></b></p><p class=\"MsoNormal\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"ilfuvd\"><span style=\"font-size: 16pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">At Internet OnitshaMarketing Ltd, we believe\r\nthat socially sustainable development can only be achieved through long term\r\ncorporate growth and therefore, intended to deliver the best – quality service\r\n– to our stakeholders; customers, business partners, employees and society by\r\n‘being a partner in development.’<o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"ilfuvd\"><span style=\"font-size: 16pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">We envision making a positive impact in our\r\nbusiness environs – in any place we do business –with strategic sustainable\r\ninitiatives through environmental initiatives, ethical business practices and\r\nresponsible economic initiatives.<o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"ilfuvd\"><span style=\"font-size: 16pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p>&nbsp;</o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"ilfuvd\"><span style=\"font-size: 18pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(0, 176, 80); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Environmental Initiatives:<o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"ilfuvd\"><span style=\"font-size: 16pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Our organization is environmentally friendly,\r\nthereby, taking it upon ourselves to uphold sustainable initiatives that are in\r\nconnection with our business objectives. For instance, our organization is\r\ncommitted to progressive installations of solar powered inverters in all our\r\ncentres, as our alternative source of electricity, in order to reduce emissions\r\nto insignificant minimum. <o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"ilfuvd\"><span style=\"font-size: 16pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p>&nbsp;</o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"ilfuvd\"><span style=\"font-size: 18pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(0, 176, 80); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Ethical Business\r\nPractices:<o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"ilfuvd\"><span style=\"font-size: 16pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">We respect and abide by local regulations and\r\nlaws. We consistently align our operations with global best practice, through\r\ncontinuous improvement of our ethical system. We look forward to our business\r\nassociates and vendors to uphold similar ethical values. <o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"ilfuvd\"><span style=\"font-size: 16pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">We emphasis on quality products and services,\r\ntherefore, we expect our vendors to supply products that have been certified as\r\nmeeting fair trade and quality standards.<o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"ilfuvd\"><span style=\"font-size: 16pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">We&nbsp; are\r\ncommitted to moral actions that encourage a positive impact on all the\r\ncompany\'s stakeholders, including employees, community, vendors, consumers, and\r\nshareholders. In addition, we also have an indirect responsibility to other\r\nstakeholders to run profitable and transparent businesses.<o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"ilfuvd\"><span style=\"font-size: 16pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p>&nbsp;</o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"ilfuvd\"><span style=\"font-size: 18pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(0, 176, 80); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Economic Responsibility:<o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\ntext-align:center;line-height:normal;tab-stops:.5in;mso-layout-grid-align:none;\r\ntext-autospace:none\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"ilfuvd\"><span style=\"font-size: 16pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">We focus on practices that facilitate the\r\nlong-term growth of the business, while also meeting the standards set for\r\nenvironmental and ethical practices. By balancing economic decisions with their\r\noverall effects on society, we hope to improve our business operations while\r\nalso engaging in sustainable practices.</span></span><span style=\"font-size:\r\n16.0pt;mso-bidi-font-size:14.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p></o:p></span></p>', 'social', '2019-03-21 16:36:49');
