(2, 8, 53, '84219563', 'HP Elitebook 840', 'Hp', 'Elitebook 840', 'silver', '<div class=\"prod_description\"><p>HP EliteBook 840 Business Laptop is that laptop you have been looking for to inspire you to high productivity in and out of your office.<br></p></div>', '', '', '<ul class=\"a-unordered-list a-vertical a-spacing-none\" xss=removed><li xss=removed><li xss=removed><li xss=removed><font color=\"#606060\" face=\"Amazon Ember, Arial, sans-serif\"><span xss=removed>Windows 10 Pro 64</span></font></li><li xss=removed><font color=\"#606060\" face=\"Amazon Ember, Arial, sans-serif\"><span xss=removed>8th Generation Intel® Core™ i5 processor</span></font></li><li xss=removed><font color=\"#606060\" face=\"Amazon Ember, Arial, sans-serif\"><span xss=removed>8 GB memory; 500 GB HDD storage</span></font></li><li xss=removed><font color=\"#606060\" face=\"Amazon Ember, Arial, sans-serif\"><span xss=removed>14\" FHD display</span></font></li></li></li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[]', '', '13.3 x 9.3 x 0.8 in', '1.65', '{\"OS-Type\":\"windows\",\"RAM\":\"8 gb\",\"Colour\":\"silver\"}', 0, '<p>One-year (1/1/0) limited warranty </p><div><br></div>', '[\"Service Center\"]', '', '[]', 'approved', 0, 140, '2019-03-08 11:48:10'),
(3, 7, 53, '81357294', 'HP Elitebook 840', 'Hp', 'Elitebook 840', '', '<div class=\"prod_description\"><p xss=\"removed\">Portable powerhouse</p><p xss=\"removed\">Combine high performance technology and long battery life with Windows 10 Pro,1 6th Gen Intel® Core™ processors,2 and a PCIe Gen3 SSD.3 Drive performance with DDR4 memory, and dual storage options3 for your most demanding business applications and fast access to data.</p><p xss=\"removed\">Slim new design with all the right ports</p><p xss=\"removed\">Connect to essential ports without the hassle of dongles. At just 18.9 mm, the ultraslim and light HP EliteBook 840 comes with VGA, Display Port, RJ-45, USB, USB-C™, and enterprise docking capabilities.</p><p xss=\"removed\">Strong security, powerful manageability</p><p xss=\"removed\">Protect, detect, and recover from malicious attacks with HP Sure Start with Dynamic Protection - the industry’s first self-healing BIOS that monitors and corrects BIOS corruption every 15 minutes.</p><p xss=\"removed\">Designed for collaboration</p><p xss=\"removed\">Replace your speaker phone with the HP EliteBook 840 with Audio by Bang & Olufsen plus HP Noise Reduction Software that provides a rich collaboration experience for applications like Skype for Business.3</p><p xss=\"removed\">Featuring<br xss=\"removed\">Let nothing stand in your way</p><p xss=\"removed\">Power through your day with Windows 10 Pro1 and the powerful, sleek, thin, and light HP EliteBook 840.<br xss=\"removed\">Self-healing safeguard</p><p xss=\"removed\">HP Sure Start with Dynamic Protection checks your BIOS every 15 minutes to detect attacks and corruption then self-heals the BIOS automatically.<br xss=\"removed\">Give your fingers a break</p><p xss=\"removed\">Enjoy a remarkable balance of comfort and feedback with the HP Premium Keyboard engineered for accuracy.<br xss=\"removed\">Storage options galore</p><p xss=\"removed\">Get the speed and space you need without having to use external storage. Dual drive support options quickly boot, wake, and run your system on a fast SSD3 and let you maintain access to your files with a high-capacity HDD.3<br xss=\"removed\">Field ready</p><p xss=\"removed\">Stand up to the workload with an EliteBook that passed MIL-STD 810G testing.4<br xss=\"removed\">In-house serviceability</p><p xss=\"removed\">Expand your system’s memory, battery, storage, and WWAN components.5<br xss=\"removed\">Impressive sound</p><p xss=\"removed\">Experience the difference with HP Clear Sound AMP and the HP EliteBook 840 speakers.</p></div>', '', '<p><b>- </b>Factory Fitted Charger<b> </b>Charger</p><p><b>- </b>Laptop bag</p><p><b>- </b>Extra Cord</p>', '<div class=\"list -features\" xss=\"removed\"><div xss=\"removed\"><table class=\"a-keyvalue prodDetTable\" xss=\"removed\"><tbody><tr><th class=\"a-color-secondary a-size-base prodDetSectionEntry\">Screen Size</th><td class=\"a-size-base\">14 inches</td></tr><tr><th class=\"a-color-secondary a-size-base prodDetSectionEntry\">Max Screen Resolution</th><td class=\"a-size-base\">2560 x 1440 pixels</td></tr><tr><th class=\"a-color-secondary a-size-base prodDetSectionEntry\">Processor</th><td class=\"a-size-base\">2.7 GHz 8032</td></tr><tr><th class=\"a-color-secondary a-size-base prodDetSectionEntry\">RAM</th><td class=\"a-size-base\">16GB</td></tr><tr><th class=\"a-color-secondary a-size-base prodDetSectionEntry\">Hard Drive</th><td class=\"a-size-base\">  - Flash Memory Solid State</td></tr><tr><th class=\"a-color-secondary a-size-base prodDetSectionEntry\">Graphics Coprocessor</th><td class=\"a-size-base\">  - HD Graphics 620</td></tr><tr><th class=\"a-color-secondary a-size-base prodDetSectionEntry\">Chipset Brand</th><td class=\"a-size-base\">  - Intel</td></tr><tr><th class=\"a-color-secondary a-size-base prodDetSectionEntry\">Card Description </th><td class=\"a-size-base\">  - Integrated</td></tr><tr><th class=\"a-color-secondary a-size-base prodDetSectionEntry\">Wireless Type</th><td class=\"a-size-base\">  - 802.11abg</td></tr><tr><th class=\"a-color-secondary a-size-base prodDetSectionEntry\">Average Battery Life (in hours)</th><td class=\"a-size-base\">  -  15.25 hours</td></tr></tbody></table></div><div xss=\"removed\"><table class=\"a-keyvalue prodDetTable\" xss=\"removed\"><tbody><tr><td class=\"a-size-base\"><table class=\"a-keyvalue prodDetTable\" xss=\"removed\"><tbody><tr><th class=\"a-color-secondary a-size-base prodDetSectionEntry\">Brand Name                                 -  Hp</th></tr></tbody></table></td></tr></tbody></table></div><div xss=\"removed\"><table class=\"a-keyvalue prodDetTable\" xss=\"removed\"><tbody><tr><td class=\"a-size-base\"><table class=\"a-keyvalue prodDetTable\" xss=\"removed\"><tbody><tr><th class=\"a-color-secondary a-size-base prodDetSectionEntry\">Operating System                        -  <span xss=\"removed\">Windows 10 Pro 64-bit Edition</span><br><br></th></tr></tbody></table></td></tr></tbody></table></div></div><div class=\"osh-table -no-border\" xss=\"removed\"></div>', 'CHARLESVILLE TECHNOLOGIES LTD', '[]', 'synthetic', '32.09 x 20.56 x 0.3 cm (12.6 x 8.09 x 0.12 in)', '340 g (0.75 lb) (max)', '[]', 0, '<p><span xss=\"removed\">One(1) Year Warranty</span><br></p>', '[]', '<p>Plot 530A Aina Akingbala Street, Omole Phase 2 Estate, Ikeja Lagos</p>', '[]', 'approved', 0, 98, '2019-03-08 11:49:08'),
(4, 8, 53, '72634815', 'HP ProBook 450 G5 Notebook PC', 'Hp', 'ProBook 450 G5 Notebook PC', '', '<div class=\"prod_description\"><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552046377/onitshamarket/product/description/eosvmzvgbcrdpnrlqeif.jpg\"><br></p><p>If style matters to you, then the HP ProBook 450 boasts providing that ultraslim design to every business. It also provides you that vivid audio engagement and easy conferencing experience with the Skype for Business™ Certified HP ProBook 450 with HP Audio Boost, HP Noise Cancellation.<br></p></div>', '', '', '<p>•<span xss=\"removed\"> </span>CPU. Intel Core i5-8250U 25.</p><p>•<span xss=\"removed\"> </span>GPU. Intel UHD Graphics 620 151.</p><p>•<span xss=\"removed\"> </span>Display. 15.6”, HD (1366 x 768), TN.</p><p>•<span xss=\"removed\"> </span>HDD/SSD. 500GB HDD, 7200 rpm.</p><p>•<span xss=\"removed\"> </span>RAM. 8GB DDR4, 2133 MHz.</p><p>•<span xss=\"removed\"> </span>Battery. 48Wh, 3-cell.</p><div><br></div>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"black\",\"silver\"]', '', '37.60 x 26.40 x 2.30 cm (14.80 x 10.40 x 0.89 in)', 'Starting at 2.10', '[]', 0, '', '[]', '', '[\"Eco Friendly\"]', 'approved', 0, 66, '2019-03-08 12:52:18'),
(5, 7, 55, '53172498', 'Lenovo Laptop : 320-14IKBA ,14.0 FHD TN AG(SLIM) ,ONYX BLACK ,I5-7200U(H) ,NO RAM ,4G DDR4 2133 ONBOARD ,1TB 7MM 540', 'Lenovo', 'Lenovo 320-141KBA', 'black', '<div class=\"prod_description\"><p>320-14IKBA ,14.0 FHD TN AG(SLIM) ,PLATINUM GREY ,I7-7500U(H) ,NO RAM ,4G DDR4 2133 ONBOARD ,1TB 7MM 5400RPM ,NO SSD , ,9.0MM SUPER MULTI(TRAY IN) ,AMD Radeon 520M 4GB DDR5L ,WIFI 1X1 AC+BT4.1 ,2CELL 30WH ,W10 HOME EM ,HD 720P WITH SINGLE MIC ,  ,2x 1.5W Dolby Audio  ,2xUSB 3.0, 1xType-C USB 3.0, HDMI, 4-in-1 (SD, SDHC, SDXC, MMC)<br></p></div>', '', '<p>Factory Fitted Charger</p>', '<div><b>- </b>320-14IKBA ,</div><div><span xss=removed>- </span>14.0 FHD TN AG(SLIM) ,</div><div><span xss=removed>- </span>BLACK</div><div><span xss=removed>- </span>I7-7500U(H) </div><div><span xss=removed>- </span>NO RAM ,4G DDR4 2133 ONBOARD</div><div><span xss=removed>- </span>1TB 7MM 5400RPM </div><div><div><span xss=removed>- </span>9.0MM SUPER MULTI(TRAY IN) ,</div><div><span xss=removed>- </span>AMD Radeon 520M 4GB DDR5L</div><div><span xss=removed>- </span>WIFI 1X1 AC+BT4.1</div><div><span xss=removed>- </span>2CELL 30WH</div><div><span xss=removed>- </span>W10 HOME EM </div><div><span xss=removed>- </span>HD 720P WITH SINGLE MIC ,</div><div><span xss=removed>- </span>2x 1.5W Dolby Audio  ,2xUSB 3.0, </div><div><span xss=removed>- </span>1xType-C USB 3.0, HDMI,</div><div><span xss=removed>- </span>4-in-1 (SD, SDHC, SDXC, MMC)</div></div>', 'CHARLESVILLE TECHNOLOGIES LTD', '[]', 'synthetic', '378 mm x 260 mm x 22.9 mm', '2.2 kg', '{\"OS-Type\":\"windows\",\"RAM\":\"4 gb\",\"Colour\":\"black\"}', 0, '', '[]', '', '[]', 'approved', 0, 48, '2019-03-08 13:54:13'),
(6, 8, 53, '89432715', 'HP PB440G5 i3-7100 14 4GB/500 PC', 'Hp', 'PB440G5', '', '<div class=\"prod_description\"><p>Full-featured, thin, and light, the HP ProBook 440 lets professionals stay productive in the office and on the go. Stylish design, linear precision, and subtle curvature and long battery life make this ProBook essential for today’s workforce.</p><p><br></p></div>', '', '', '<p>Windows 10 Pro 64</p><p>7th Generation Intel® Core™ i3 processor</p><p>4 GB memory; 500 GB HDD storage</p><p>14\" diagonal HD display</p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[]', '', '13.23 x 9.37 x 0.79 in', '1.63', '{\"OS-Type\":\"windows\",\"RAM\":\"4 gb\",\"Colour\":\"silver\"}', 0, '<p>HP Elite Support with limited 1-year standard parts and labour (1/1/0) warranty; Terms and conditions vary by country; Certain restrictions and exclusions apply.</p><div><br></div>', '[\"Service Center\"]', '', '[\"Eco Friendly\"]', 'approved', 0, 48, '2019-03-08 14:03:08'),
(7, 8, 53, '23815674', 'HP EliteBook 1040 G4 Notebook PC', 'Hp', 'EliteBook 1040', 'silver', '<div class=\"prod_description\"><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552057040/onitshamarket/product/description/gqte8tznnn0a8gwdsng5.png\"><br></p><p>HP\'s 14-inch EliteBook 1040 G4 is a solid business notebook that\'s as good for play as it is for work. That\'s because its bright, vibrant display offers great picture quality, and its Bang & Olufsen-tuned speakers produce solid sound. The high-powered, quad-core model offers a ton of speed, while the dual-core (Intel U-Series) model lasts over 10 hours on a chargeFrom its excellent audio to its vibrant display, there\'s a lot to love about this laptop.<br></p></div>', '', '', '<p>Intel® Core™ i7-7820HQ Processor with Intel® HD Graphics 630 (2.9 GHz base frequency, up to 3.9 GHz with Intel® Turbo Boost Technology, 8 MB cache, 4 cores)</p><p>Windows 10 Pro 64</p><p>16 GB DDR4-2133 SDRAM (onboard)</p><p>1 TB PCIe® NVMe™ SSD</p><p>Intel® HD Graphics 630</p><p>Starting at 1.36 kg</p><p>35.56 cm(14) diagonal FHD IPS eDP anti-glare LED-backlit, 300 cd/m², 72% sRGB with privacy screen (1920 x 1080)</p><p>3 Year Onsite Warranty with 1 year ADP</p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"silver\"]', '', '32.89 x 23.28 x 1.59 cm', 'Starting at 1.36 kg', '[]', 0, '<p>3 Year Onsite Warranty with 1 year ADP</p><p><br></p><div><br></div>', '[\"Service Center\"]', '', '[\"Eco Friendly\"]', 'approved', 0, 54, '2019-03-08 15:06:58'),
(10, 7, 54, '35764218', 'HP 250G6 PentN4200 15 4GB/500 PC', 'Hp', 'HP 250G6', 'black', '<div class=\"prod_description\"><p>The HP 250 G6 Notebook PC combines efficiency and value-pricing in one sleek sweep. The G6 comes fully loaded with all the essential business tools you need and is powered by an Intel Celeron Processor and is housed by a durable chasis to help protect your notebook from the rigors of the day. The HP 250 G6 has an Intel Celeron-1.6 GHz (4GB,500GB HDD)  15.6-Inch and it comes with Windows 10 Professional.</p><p><br></p><p><b>Designed for Mobility</b></p><p>The HP 250 G6 is designed for mobility. With a professional look and a chassis that protects your notebook and keeps it in best shape, the HP 250 G5 is ready for the day.</p><p><br></p><p><br></p><p><b>Ready for Business</b></p><p>The HP 250 is powered by an Intel Celeron Processor so you can confidently complete projects. There\'s a 4GB RAM for enhanced multi-tasking, so nothing will slow you down. </p><p><br></p><p><b>Extras that polish the experience</b></p><p>The HP 250 G6 is fully functional, allowing you to connect to all your peripherals. </p><p><br></p><p><b>Excellent entertainment</b></p><p>The HP 250 G6 comes with an optional SuperMulti DVD+/-RW drive allows you to watch DVDs and create backups for your work.</p><p><br></p><p><br></p><p><b>Be your best virtual self</b></p><p>Look and be your best self in online conversations. The optional HD Webcam allows you to look your best at all times, even in low light conditions.</p><p><br></p><p><b>Cut out the chatter</b></p><p>With HP Noise Reduction Software, you can reduce ambient noise including keyboard clicks.</p></div>', '', '', '<p>Production country     -  United States</p><p>Size (L x W x H cm)     -   38.43 x 25.46 x 2.43 cm</p><p>Weight (kg)<span xss=\"removed\"> </span>               -   3.5Kg</p><p>Colour<span xss=\"removed\"> </span>                        -   Black</p><p>Display Size          <span xss=\"removed\"> </span>-   15.6 Inch</p><p>Internal Memory  <span xss=\"removed\"> </span>-   4GB</p><p>Hard Disk                       -    500GB</p><p>CPU Speed            <span xss=\"removed\"> </span>-    1.60(GHz)</p><p>Processor Type<span xss=\"removed\"> </span>        -    Intel Celeron</p><p>Operating System<span xss=\"removed\"> </span>-    Windows 10 Professional</p><p>Display Features<span xss=\"removed\"> </span>        -    Full HD</p><p>Camera:                         -    Webcam and Microphone</p><p>Battery:                         -    4 Cell Battery</p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"black\"]', 'synthetic', '38.43 x 25.46 x 2.43', '3.5Kg', '{\"OS-Type\":\"Windows\",\"RAM\":\"4 GB\",\"Colour\":\"Black\"}', 0, '', '[]', '', '[]', 'approved', 0, 38, '2019-03-08 23:26:27'),
(11, 7, 53, '14578932', 'HP Laptop 15-ra011nia', 'Hp', 'HP Notebook - 15-ra011nia', 'black', '<div class=\"prod_description\"><p>Power through your day with a stylish laptop created to keep you connected, and on top of everyday tasks. With reliable performance and long lasting battery life1—you can easily surf, stream and stay in touch with what matters most.</p><p>The PC you can rely on</p><p><br></p><p>With the latest Intel2 processors you are guaranteed the reliable performance you need to work and play. Enjoy long-lasting durability on a laptop designed to do what you want with ease.</p><p><br></p><p>Connect with what matters</p><p><br></p><p>Stay entertained and keep connected with friends and family on a rich HD or on select models FHD display and HD3 camera on select models. Plus, easily store and enjoy your favorite music, movies, and photos.</p><p><br></p><p>Thoughtfully designed. Inside and out.</p><p><br></p><p>Beautifully designed inside and out this HP diagonal 39.6 cm (15.6\") laptop is perfectly suited for your lifestyle. Playful patterns, unique textures and a chrome plated hinge (on select models) add a little color to your everyday.</p><p><br></p><p>Featuring</p><p>Dropbox cloud storage</p><p><br></p><p>Store and synchronize your content online with Dropbox. Get 25 GB of storage for one year to access, manage, and share your photos, music, and files from anywhere with Internet access.5</p><p>Dual-core Intel® Celeron® processor</p><p><br></p><p>The perfect combination of performance, power consumption, and value helps your device run smoothly and reliably with two processing cores to handle all your tasks.7</p><p>Hard drive storage</p><p><br></p><p>Don’t worry about growing your collection of digital movies, songs, and pictures. With massive storage options you can save it all, and still have plenty of room left over.</p><p>Liberating battery life</p><p><br></p><p>Take on your day without worrying about recharging. With up to 11 hours of battery life, you can work, watch more, and spend more of your time totally untethered.9</p><p>High-definition display</p><p><br></p><p>See your digital world in a whole new way. Enjoy movies and photos with the great image quality and high-definition detail of 1 million pixels.4</p><p>Intel® HD graphics</p><p><br></p><p>Impressive graphics help with everything you do. Whether it\'s watching a video or just surfing the web, Intel® HD Graphics render all the visuals on your screen with smooth, vivid quality.</p><p>RAM options</p><p><br></p><p>RAM is essential for multitasking and powering demanding programs like video editing software and games. The more RAM you choose, the better performance you’ll enjoy.</p><p>USB-C™</p><p><br></p><p>Power your device, transfer up to 5Gb/s of signaling rate, or connect to an external display all from just one USB-C™ port. And it\'s reversible, so you never have to worry about plugging in upside down.8</p><p>Dual front-facing speakers</p><p><br></p><p>Pump up the volume to your favorite music, movie or game. When your audio is directed towards you, nothing comes between you and your entertainment.</p></div>', '', '<p>Factory Fitted Charger</p>', '<p>Microprocessor             -         Intel® Celeron® N3060 (1.6 GHz base frequency, up to 2.48 GHz burst frequency, 2 MB cache, 2 cores)</p><p>Memory, standard        -         4 GB DDR3L-1600 SDRAM (1 x 4 GB)</p><p>Video graphics               -        Intel® HD Graphics 400</p><p>Hard drive                       -        500 GB 5400 rpm SATA</p><p>Optical drive                   -        DVD-Writer</p><p>Display                             -        15.6\" diagonal HD SVA anti-glare micro-edge WLED-backlit (1366 x 768)</p><p>Pointing device               -        Touchpad with multi-touch gesture support</p><p>Wireless connectivity    -        802.11b/g/n (1x1) and Bluetooth® 4.0 combo</p><p>Network interface          -        Integrated 10/100/1000 GbE LAN</p><p>Expansion slots              -        1 multi-format SD media card reader</p><p>External ports                 -        2 USB 3.1 Gen 1 (Data transfer only); 1 USB 2.0; 1 HDMI; 1 RJ-45; 1 headphone/microphone combo</p><p>Power supply type         -        45 W AC power adapter</p><p>Battery type                    -        3-cell, 31 Wh Li-ion</p><p>Battery life mixed usage       -      Up to 11 hours and 45 minutes</p><p>Video Playback Battery life   -   Up to 9 hours and 30 minutes</p><p>Webcam                                   -   HP Webcam with integrated digital microphone</p><p>Audio features                         -   Dual speakers</p><p>Software  Operating system -   FreeDOS 1.2</p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"black\"]', 'synthetic', '38 x 25.38 x 2.38 cm', '2.1 kg', '{\"OS-Type\":\"windows\",\"RAM\":\"4 gb\",\"Colour\":\"black\"}', 0, '<p>One(1) Month Warranty </p>', '[\"Replacement by vendor\"]', '<p>Plot 530A Omole Phase 2 Estate, Aina Akingbala Street, Ikeja Lagos</p>', '[]', 'approved', 0, 54, '2019-03-09 00:41:18'),
(12, 7, 53, '45196732', 'HP ProBook 450 G4 i5-7200U 15 4GB/500 PC/W10P', 'Hp', 'HP ProBook 450', 'silver', '<div class=\"prod_description\"><p><b>Designed for mobility:</b></p><p> Work in style with the powerful 15.6-inch diagonal HP ProBook 450 with a new asteroid silver design. Confidently take on the day with a PC that’s designed to pass MIL-STD 810G testing2, built with an aluminum reinforced keyboard.</p><p><br></p><p><b>Powerful processing:</b> </p><p>Power through projects with 7th Gen Intel® Core™ processors3</p><p><b>Safeguard data and devices:</b> </p><p>Help keep sensitive data secure with comprehensive security features like HP BIOSphere5 as well as the embedded TPM and fingerprint reader6.</p></div>', '', '', '<p><br></p><table class=\"table table-bordered\"><tbody><tr><td><b>Brand</b></td><td>HP<br></td></tr><tr><td><b>Series </b><br></td><td>ProBook</td></tr><tr><td><b>Model</b></td><td>450 G4</td></tr><tr><td><b>Operating System</b><br></td><td>Windows 10 Pro 64-Bit<br></td></tr><tr><td><b>CPU Type</b><br></td><td> Intel Core i5 7th Gen<br></td></tr><tr><td><b>Screen Size</b><br></td><td>15.6\" Inch</td></tr><tr><td><b>Wide Screen Support</b><br></td><td>Yes</td></tr><tr><td><b>HDD</b><br></td><td>500GB<br></td></tr><tr><td><b>RAM</b></td><td>4GB</td></tr><tr><td><b>Graphic Type</b><br></td><td>Integrated Card<br></td></tr><tr><td><b>WLAN</b><br></td><td>Intel Dual Band Wireless-AN 7265 802.11a/b/g/n (2x2)<br></td></tr><tr><td></td><td><b>GPU/VPU</b></td><td></td><td></td><td> Intel HD Graphics 620<br></td></tr><tr><td><b>Optical Drive Type</b><br></td><td>DVD Super Multi<br></td></tr><tr><td><b>Memory Slot (Total)</b><br></td><td> 2<br></td></tr><tr><td><b>Bluetooth</b> <br></td><td>Bluetooth 4.0<br></td></tr><tr><td><b>Battery</b><br></td><td>  HP 3-cell, 48 Wh Long Life Li-ion<br></td></tr><tr><td><b>AC Adapter</b><br></td><td>45-watt AC adapter<br></td></tr><tr><td><b>Webcam</b><br></td><td> 720p HD webcam<br></td></tr><tr><td><b>Speaker</b><br><