(13, 7, 53, '95271436', 'HP 255G6 E2-9000 15 4GB/500 PC', 'Hp', 'HP 255G6 E2-9000', 'black', '<div class=\"prod_description\"><p>Durable and Efficient<br></p><p>The HP 255 G6 Notebook is equipped for business. Work confidently with your road ready PC. Powered by an impressive AMD Processor, this value-priced laptop provides all that you need to be productive, including essential multimedia tools.</p><p><br></p><p><b>Strong Versatile Design </b><br></p><p>Highlighting a solid sleek design, you can trust the HP 255 to keep up with all your tasks and assignments on the go. Your portable PC is secured, despite everything it looks proficient.<br></p><p><br></p><p><b>Incredible Excitement</b><br></p><p>The HP 255 G6 highlights an optional SuperMulti DVD+/ - RW drive which gives completely clear pictures and sound clarity from DVDs for work or play. </p><p><br></p><p><b>Optional VGA Webcam </b></p><p>Appreciate stunning eye to eye discussions with the VGA Webcam. You\'ll generally look great, even in low light. </p><p><br></p><p><b>Effortless Data Transfer </b></p><p>Go down and rapidly move your data to and from your HP 255 with the quick and advantageous SD card opening. </p><p><br></p><p><b>Straightforward Wireless Printing </b></p><p>Improve utilization of your workspace. HP ePrint makes remote printing straightforward, no requirement for drivers.</p><p><br></p><p><b>Little Extras That Improve Your Experience </b></p><p>Your HP 255 G6 Notebook comes integrated with every one of the ports you require to associate for a full interactive media experience. Connect every one of the peripherals you require for business and appreciate the advantages of a completely practical scratch pad. </p></div>', '', '', '<p><span xss=removed>Processor family                     -        </span>7th Generation AMD E2 APU processor</p><p><span xss=removed>Chipset                                     -         </span>Chipset is integrated with processor</p><div><span xss=removed>Weight       