(16, 7, 55, '52941678', 'Lenovo Laptop: 320-14IKBA ,14.0 FHD TN AG(SLIM) ,PLATINUM GREY ,I5-7200U(H) ,NO RAM ,4G DDR4 2133 ONBOARD ,1TB 7MM', 'Lenovo', 'Lenovo Laptop: 320-14IKBA', 'silver', '<div class=\"prod_description\"><p>Everything about the IdeaPad 320 is designed to simplify your life. It can handle any task with ease, thanks to powerful processing and discrete graphics options. Preloaded with Windows 10 Home, you\'ll have the personal assistance of Cortana, designed to help open apps and answer your questions — whether typed or spoken. From the new streamlined design to a cleaner desktop interface, you\'ll enjoy the simplicity that IdeaPad 320 offers.<br></p><p>Up to top-of-the-line 6th Gen Intel® Core™ i3 processing, plus up to 4GB DDR4 memory, guarantee lightning-fast responsiveness and reliable performance. Run multiple programs simultaneously, and transition seamlessly between web tabs — you\'ll be able to multitask with ease.<br></p><p>The IdeaPad 320 brings you Windows 10 Home, featuring a host of exciting new features. Best of all, it works across all your Windows 10 devices to keep you organized.<br></p><p>Featuring Dolby Audio-optimized speakers, the IdeaPad 320 delivers crystal-clear audio with minimal distortion at any volume. Stream your favorite playlist or video chat with family — you\'ll hear every detail.<br></p></div>', '', '', '<p>LENOVO 320-14IKBA </p><p>PLATINUM GREY </p><p>I5-7200U(H) </p><p>4G DDR4 2133 </p><p>1TB 7MM 5400RPM ,</p><p>AMD Radeon 530M 2GB DDR5L ,</p><p>14.0 FHD TN AG(SLIM) ,</p><p>9.0MM SUPER MULTI(TRAY IN) ,</p><p>HD 720P WITH SINGLE MIC ,</p><p>WIFI 1X1 AC+BT4.1 ,</p><p>2CELL 30WH , 2x 1.5W </p><p>Dolby Audio , Arabic</p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"silver\"]', 'metal', '', '2.2kg', '{\"OS-Type\":\"windows\",\"RAM\":\"4 gb\",\"Battery-Life\":\"upto 6hrs\",\"Colour\":\"grey\"}', 0, '<p><br></p>', '[]', '', '[]', 'approved', 0, 16, '2019-03-09 23:07:21'),
