(18, 8, 31, '98762154', 'Samsung 55&quot; FHD Flat Smart TV M6000 Series 6', 'Samsung', '55&quot; FHD Flat Smart TV M6000 Series 6', 'black', '<div class=\"prod_description\"><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552294400/onitshamarket/product/description/kmtggi9gb8dqfhas8htr.png\" xss=removed><br></p><p>If you want a promising rich viewing experience, then the Samsung M6000 is that interesting offering in Samsung’s 6 Series range, which also features the M6000. You probably should check this one out if you are in the market for a slim set that also looks to deliver high-quality pictures.<br></p></div>', '', '', '<p>43-inch, 49-inch, 55-inch Panel (Depends on Country)</p><p>Flat LED Panel</p><p>1920 x 1080, Full Screen</p><p>Smart TV</p><p>Screen Mirroring</p><p>Analog Tuner</p><p>Wi-Fi with Wi-Fi Direct</p><p>3 HDMI ports, 2 USB ports, 1 Ethernet</p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[]', '', '1400.0 x 819.0 x 140.0 mm', '23.2 kg', '{\"Sceen-Size\":\"55 inches\"}', 0, '<p>Samsung Warranty</p>', '[\"Service Center\"]', '', '[\"Eco Friendly\"]', 'approved', 0, 22, '2019-03-11 09:24:55'),
(19, 8, 33, '64719285', 'Samsung 40&quot; Full HD Digital LED TV', 'Samsung', '40&quot; Full HD Digital LED TV', 'black', '<div class=\"prod_description\"><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552298184/onitshamarket/product/description/opbwxptukiu312dlxy7w.png\"><br></p><p>If you are searching for the right TV for your couch. Then we recommend you shake things up, and give yourself the freedom to decorate the way you want to, not the way you have to. So we bring you the new 40\" FHD Flat Smart TV K5300 Series 5. It’s fun, playful and unique, and it goes anywhere. Best of all? It fits your lifestyle, not the other way around. goes. </p></div>', '', '', '<ul><li>Smart TV 2.0 / Smart Hub</li><li>Smart TV with Apps, S-Recommendation and Full Web Browser</li><li>AllShare</li><li>Smart View : Clone View</li><li>Auto Volume Leveler</li><li>ConnectShare™ Movie</li><li>USB HID Support</li><li>Anynet+™ (HDMI-CEC)</li><li>Smart Phone Remote supported</li><li>More Details</li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[]', '', '974.0 x 644.0 x 132.0 mm', '10.0 kg', '[]', 0, '<p>Samsung Warranty</p>', '[\"Service Center\"]', '', '[\"Eco Friendly\"]', 'approved', 0, 24, '2019-03-11 10:05:27'),
(20, 8, 36, '87962143', 'Samsung 55&quot; KU7350 Curved 4K UHD TV', 'Samsung', '55&quot; KU7350 Curved 4K UHD TV', 'black', '<div class=\"prod_description\"><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552301414/onitshamarket/product/description/iui8luuibpymudhuujjp.png\"><br></p><p>If you want to enjoy unseen details hidden in the brightest parts of the TV screen when watching HDR content as well as get a theatre-like and a true HDR experience that will be finally available right in your living room, then look no further because we have for you the Samsung 55\" KU7350 Curved 4K UHD TV, that will help you experience vivid detail with 4X the resolution of Full HD TV. Everything you watch will look better thanks to its true-to-life colour and brightness.</p><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552301493/onitshamarket/product/description/ke73dcfuyxlbx68mvks0.png\"><br></p><p><br></p></div>', '', '', '<p>Refresh Rate: 120MR (Effective)</p><p>Backlight: LED</p><p>Smart Functionality: Yes, Built in Wi-Fi: Yes</p><p>Dimensions (W x H x D): TV without stand: 48.5\" x 28.1\" x 3.8\", TV with stand: 48.5\" x 30.9\" x 13.1\"</p><p>Inputs: 3 HDMI, 2 USB</p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[]', '', '1427.0 x 819.0 x 195.0 mm', '23.4 kg', '{\"Sceen-Size\":\"55 inches\"}', 0, '<p>Samsung Warranty</p>', '[\"Service Center\"]', '', '[\"Eco Friendly\"]', 'approved', 0, 24, '2019-03-11 10:59:42'),
(21, 8, 33, '45879162', 'Samsung 75&quot; MU7000 4K UHD TV + 1 FREE Samsung 49&quot; Full HD LED TV 5 Series', 'Samsung', '75&quot; MU7000 4K UHD TV', 'silver', '<div class=\"prod_description\"><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552307190/onitshamarket/product/description/v9b3bthkklsvedcxfkxd.png\"><br></p><p>If you want to experience crystal clear, lifelike colour, with more than one billion hues, then the Samsung 75\" MU7000 4K UHD TV with its Dynamic Crystal Colour display will deliver picture-perfect results. We also guarantee you will see stunningly clear movement with Supreme Motion for action scenes and every shot on goal.</p><p>And guess what? We are also giving you 1 FREE Samsung 49\" Full HD LED TV 5 Series to along with it!!! Can you possibly get any deal better than that anywhere?</p><p><br></p><p><br></p></div>', '', '', '<ul><li>PurColor: Enjoy millions of shades of color, fine tuned to create an incredibly vibrant picture</li><li>Motion Rate 120: Smooth action on fast-moving content</li><li>HDR: View stunning high dynamic range content with a TV designed to support HDR10+</li><li>Slim Design: An elegant slim design for a modern look you’ll admire</li><li>Smart TV: Access your streaming services all in one place using the Samsung Remote Control</li><li>Please note the differences between the UN75NU7100 and the UN75NU710D. NU7100: Dark gray stand color, 450 nits HDR sustained brightness, Mega Dynamic Contrast. NU710D: Charcoal black stand color, 430 nits HDR sustained brightness, Ultra Dynamic Contrast.</li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[]', '', '1859 x 1132 x 229 mm', '52,40 kg', '[]', 0, '<p>Samsung Warranty</p>', '[\"Service Center\"]', '', '[\"Eco Friendly\"]', 'approved', 0, 16, '2019-03-11 12:34:42'),
(22, 8, 33, '83496712', 'Samsung 49&quot; Full HD LED TV 5 Series', 'Samsung', '49&quot; Full HD LED TV 5 Series', '', '<div class=\"prod_description\"><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552308093/onitshamarket/product/description/e5dojcwo3mfnrssgj0uw.png\"><br></p><p><br></p><p>If you want to enjoy a greater level of home entertainment realism than ever before. Then thanks to a resolution twice as high as standard HD TVs, your Samsung FHD TV delivers a breathtaking viewing experience that takes you beyond the screen into a world of total immersion. When you’ve seen the rich and vivid texture of Full HD images, your favourite TV programs and movies will never be the same again. Discover reality with a full high definition experience.</p><p><br></p><p><br></p></div>', '', '', '<ul><li>FHD Resolution: 1920 x 1080</li><li>Smart Hub</li><li>2 HDMI Ports</li><li>USB Video</li><li>Ethernet (LAN)</li><li>Audio Out (Mini Jack)</li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"black\",\"silver\"]', '', '1402.0 x 758.0 x 180.0 mm', '16.5 kg', '[]', 0, '<p>Samsung Warranty</p>', '[\"Service Center\"]', '', '[\"Eco Friendly\"]', 'approved', 0, 12, '2019-03-11 12:48:32'),
(23, 8, 31, '43685921', 'Samsung 55&quot; Premium UHD Smart TV MU7000 Series 7', 'Samsung', '55&quot; Premium UHD Smart TV MU7000 Series 7', 'silver', '<div class=\"prod_description\"><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552310589/onitshamarket/product/description/apkdvcwttzwgtexf9eil.png\"><br></p><p>If you want to experience the illuminating power and bold contrast of High Dynamic Range as well as see every single detail and enjoy cinematic clarity in every scene in almost any lighting condition. Then the Samsung 55\" Premium UHD Smart TV MU7000 Series 7 is the TV for you.</p><div><br></div><p><br></p><p><br></p><p><br></p></div>', '', '', '<ul><li>3,840 x 2,160 Resolution</li><li>HDR 1000 HDR (High Dynamic Range)</li><li>One Connect Mini One Connect (Jack)</li><li>2300 PQI (Picture Quality Index)</li><li>4 HDMI</li><li>3 USB</li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[]', '', '1383.0 x 819.0 x 160.0 mm', '24.2 kg', '{\"Sceen-Size\":\"55 inches\"}', 0, '<p>Samsung Warranty</p>', '[\"Service Center\"]', '', '[\"Eco Friendly\"]', 'approved', 0, 16, '2019-03-11 13:26:17'),
(24, 8, 31, '38256741', 'Samsung 65&quot; Premium UHD Smart TV MU7000 Series 7', 'Samsung', '65&quot; Premium UHD Smart TV MU7000 Series 7', 'silver', '<div class=\"prod_description\"><p><br></p><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552312515/onitshamarket/product/description/hp1czu1kzhyuip6wtknu.png\"><br></p><p>If experiencing the illuminating power and bold contrast of High Dynamic Range is what you want. Then the Samsung 65\" Premium UHD Smart TV MU7000 Series 7 is what you need. It will help you see every single detail and enjoy cinematic clarity in every scene in almost any lighting condition.</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p></div>', '', '', '<ul><li>3,840 x 2,160</li><li>Resolution HDR 1000 HDR (High Dynamic Range)</li><li>One Connect Mini One Connect (Jack)</li><li>2300 PQI (Picture Quality Index)</li><li>4 HDMI</li><li>3 USB</li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[]', '', '1582.0 x 967.0 x 175.0 mm', '33.20 kg', '[]', 0, '<p>Samsung Warranty</p>', '[\"Service Center\"]', '', '[\"Eco Friendly\"]', 'approved', 0, 24, '2019-03-11 13:38:46');
