(30, 7, 53, '47613289', 'HP ProBook 250 G6 Notebook PC', 'Hp', 'HP ProBook', '', '<div class=\"prod_description\"><p>Full-featured, thin and light. The HP ProBook 250 lets professionals stay productive in the office and on the go. Stylish design, linear precision, and subtle curvature plus optional Quad Core2 performance and long battery life make this ProBook essential for today’s workforce.</p><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552380027/onitshamarket/product/description/ofp6snzbhetv8xnk8v76.jpg\"><br></p><p><span xss=removed>System features</span></p><p>Processor family 7th Generation Intel® Core™ i3 processor chipset</p><p>Chipset is integrated with processor</p><p>Environmental Low halogen 20 </p><p><span xss=removed>Dimensions and weight</span></p><p>Dimensions (W x D x H) 37.6 x 26.41 x 2.08 cm (non-touch); 37.6 x 26.41 x 2.28 cm (touch)</p><p>Weight Starting at 2.1 kg (Weight varies by configuration and components)</p><p><span xss=removed>Memory</span></p><p>4 GB DDR4-2400 SDRAM (1 x 4 GB)</p><p>Memory Slots 2 SODIMM</p><p><span xss=removed>Storage</span></p><p>Internal drive 500 GB 7200 rpm SATA</p><p><span xss=removed>Display and graphics</span></p><p>Display 39.6 cm (15.6\") diagonal HD SVA anti-glare LED-backlit, 220 cd/m2, 45% sRGB (1366 x 768)</p><p>Graphics Integrated: Intel® HD Graphics 620</p><p><span xss=removed>Communications</span></p><p>Wireless Intel® Dual Band Wireless-AC 8265 802.11a/b/g/n/ac (2x2) Wi-Fi® and Bluetooth® 4.2 Combo</p><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552380125/onitshamarket/product/description/qiqzsbzkbybhgoohoqv7.jpg\" xss=removed><br></p><p><br></p><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552380313/onitshamarket/product/description/ylbyfhxuinmdikffanjv.png\" xss=removed><br></p><p>Get connected with the value-priced HP 250 Notebook PC. Complete business tasks with Intel® technology, essential collaboration tools and Windows 10