(31, 7, 53, '17239465', 'HP ProBook 450 G4 i3-7100U 15 4GB/500 PC/W10P', 'Hp', 'HP ProBook 450', 'silver', '<div class=\"prod_description\"><p><b>Designed for mobility</b></p><p>Work in style with the powerful 39.6 cm (15.6-inch) diagonal HP ProBook 450 with a new asteroid silver design. Confidently take on the day with a PC that’s designed to pass MIL-STD 810G testing, built with an aluminum reinforced keyboard.</p><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552394055/onitshamarket/product/description/qpej8zjcfm8xhcbbav8y.png\" xss=removed><br></p><p><b>Powerful processing</b></p><p>Power through projects with 7th Gen Intel® Core™ processors and optional NVIDIA® GeForce® discrete graphics.</p><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552394092/onitshamarket/product/description/z9mg0fuiztc2pxkhfnyp.jpg\" xss=removed><br></p><p><b>Safeguard data and devices</b></p><p>Help keep sensitive data secure with comprehensive security features like HP BIOSphere as well as the embedded TPM and an optional fingerprint reader.</p><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552394137/onitshamarket/product/description/urfpu1jmm5oofehziwn6.jpg\" xss=removed><br></p><p><b>Immersive experience</b></p><p>Enjoy the rich user experience of the HP ProBook 450 with long battery life and features designed to create a stunning visual and audio experience with HP Audio Boost, HP Noise Cancellation, and options like an FHD display, and an HD touch display.</p></div>', '', '<p>Laptop and factory fitted charger</p>', '<p><font color=\"#555555\" face=\"Roboto, Helvetica, Arial, sans-serif\"><span xss=removed>SPECIFICATIONS OF PROBOOK 450 G4 INTEL® CORE™ I3-7100U PROCESSOR (3M CACHE, 2.40 GHZ), 15.6 INCHES,NVIDIA® GEFORCE 930MX (2 GB DDR3 DEDICATED), 4GB RAM, 500GB HDD, INTEL® 802.11B/G/N/AC (1X1) WIFI® AND BLUETOOTH®, FREEDOS, COLOUR: SILVER</span><br></font></p><p><br></p><table class=\"table table-bordered\"><tbody><tr><td><b>Product Name</b></td><td>HP PROBOOK 450 G4<br></td></tr><tr><td><b>Display Size (inches)</b></td><td>15.6</td></tr><tr><td><b>RAM</b></td><td>4GB</td></tr><tr><td><b>Storage Size</b></td><td>500GB</td></tr><tr><td><b>Color</b></td><td>Black and Silver</td></tr></tbody></table><p><font color=\"#555555\" face=\"Roboto, Helvetica, Arial, sans-serif\"><span xss=removed>Built for productivity, the HP ProBook 450 delivers the performance and security features essential for today’s workforce. The sleek and tough design provides professionals a flexible platform to stay productive in or out of the office.</span><br></font><br></p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"silver\"]', 'synthetic', '38.20 x 26.30 x 2.44 cm', '3.48kg', '{\"OS-Type\":\"windows\",\"RAM\":\"4 gb\",\"Sceen-Size\":\"others\",\"Colour\":\"silver\"}', 0, '<p>One(1) Year Warranty</p>', '[\"Replacement by vendor\"]', '<p>Plot 530A Aina Akingbala Street, Omole Phase 2 Estate, Ikeja Lagos</p>', '[]', 'approved', 0, 28, '2019-03-12 12:55:33'),
(32, 7, 53, '51394826', 'HP EB1040G4 i5-7200U 14 8GB/256 HSPA PC', 'Hp', 'HP EB1040G4', 'silver', '<div class=\"prod_description\"><p><b>Power at a whole new level</b><br></p><p>Great power gives great productivity. The 35.56 cm (14 \") diagonally powerful, ultra-slim portable enterprise PC speeds up your day, making even the most difficult tasks easy - with powerful multitasking, on-the-go, and industry-leading security.</p><p><br></p><p><b>Don\'t let anything get in your way</b></p><p>Make work a game with Windows 10 Pro [1] and the powerful yet elegant, thin HP EliteBook 1040.</p><p><br></p><p>High performance, high portability.</p><p><br></p><p><b>Surf safely online</b></p><p>Help protect your computer from infected websites, malicious software, ransomware, and viruses with HP Sure Click [5] - hardware-induced web browser security.</p><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552396983/onitshamarket/product/description/i19wfrtiob1p8frjejkc.jpg\" xss=\"removed\"><br></p><p><b>Keep visual hackers in the dark</b></p><p>Instantly protect against visual hacking with the optional HP Sure View [6] screen with built-in privacy capability. By pressing a button, the screen appears to be unreadable to those around you, while viewing the content clearly.</p><p><br></p><p><b>Self-repairing protection</b></p><p>Start with a real HP BIOS every time. HP Sure Start Gen3 [7] monitors the BIOS memory, restores the platform without user or administrator intervention, restores the BIOS to a custom state and is set up for centralized management.</p><p><br></p><p><b>Charge quickly</b></p><p>You never have to take your phone out of your pocket again</p><p>With HP PhoneWise, you can answer calls and messages to iOS and Android ™ through your computer [9].</p><p><br></p><p><b>Simple connections</b></p><p>Stay productive with key ports for optional docking [5] and connect to networks with Wi-Fi and optional 3G / 4G LTE [10].</p><p><br></p><p><b>See everything much clearer.</b></p><p>FHD or UHD touch screens allow you to choose the right monitor to suit your work mode [4].</p><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552397028/onitshamarket/product/description/dppnocz8xiteprxstlq2.jpg\" xss=\"removed\"><br></p><p>- Windows 10 Pro 64-bit</p><p>- Intel® Core ™ i5-7200U (3MB Cache, 2.50GHz)</p><p>- 35.6 cm (14 \") Full HD 1920 x 1080</p><p>- 8GB (2133MHz) DDR4-SDRAM & 256GB SSD</p></div>', '', '<p>Plot 530A Aina Akingbala Street, Omole Phase 2 Estate, Ikeja Lagos</p>', '<p><b>Model  </b>                                              -                 HP EliteBook 1040<br></p><p><b>Product Color</b>                                    -                 Silver</p><p><b>Product Type</b>                                     -                  Notebook</p><p><b>Screen</b>                                                -                  Screen diagonal 35.6 cm (14 \")</p><p><b>Screen resolution</b>                             -                  1920 x 1080 pixels</p><p><b>Screen Size</b>                                        -                 14\" inch</p><p><b>Mobile broadband</b>                           -                  Yes<br></p><p><b>LED backlight</b>                                    -                  Yes</p><p><b>Touchscreen</b>                                      -                   No<br></p><p><b>System bus data transfer rate</b>        -                  4 GT / s</p><p><b>Operating System</b>                             -                 Windows 10 Pro 64-bit</p><p><b>Processor</b>                                            -                 Intel® Core ™ i5-7200U (3MB Cache, 2.50GHz)</p><p><span xss=\"removed\">Processor cache</span>                                 -                  3MB</p><p><b>RAM</b>                                                     -                  8GB (2133MHz) DDR4-SDRAM</p><p><b>Internal Storage</b>                                 -                  256GB SS