(40, 7, 53, '91827435', 'HP ProBook 450 G3 i3-6100U', 'Hp', 'ProBook 450 G3', 'silver', '<div class=\"prod_description\"><p>The HP ProBook 450 G3  is built for productivity and it delivers the performance and security features essential for today’s workforce. The sleek and tough design provides professionals a flexible platform to stay productive in or out of the office.</p><p><br></p><p><b>Designed for mobility</b></p><p>Work in style with the powerful 39,6 cm (15.6\") diagonal HP ProBook 450 G3 with a new gravity black LCD cover. Confidently take on the day with a PC built with an aluminum reinforced keyboard deck and 120,000 hours of HP Testing.</p><p><br></p><p><b>Powerful processing</b></p><p>Power through projects with 6th Gen Intel® Core™ processors1 and optional discrete 2AMD Radeon™ graphics with switchable graphics support.3</p><p><br></p><p><b>Safeguard data and devices</b></p><p>Help keep sensitive data secure with comprehensive security features like HP BIOSphere4 as well as the embedded TPM.5</p><p><br></p><p><b>Immersive experience</b></p><p>Enjoy the rich user experience of the HP ProBook 450 G3 with long battery life and features designed to create a stunning visual and audio experience with options like an FHD display,2 an HD touch display, 2 and DTS Studio Sound.™</p><p><br></p><p><b>Let nothing stand in your way</b><br></p><p>Be productive in any situation. Experience the new features of Windows 10 Pro on the powerful, touch optional HP ProBook 450 G3.</p><p><br></p><p><b>Tested to go the distance</b></p><p>Stand up to the workload with an ProBook that passed MIL-STD 810G testing.</p><p><br></p><p><b>Help secure critical data</b></p><p>With TPM your critical data has protection with hardware-based encryption keys.</p><p><br></p><p><b>Protect against minor spills</b></p><p>Help protect your ProBook from minor spills with a spill-resistant HP Premium Keyboard.</p><p><br></p><p><b>Proactively monitor and troubleshoot</b></p><p>Avoid surprises by tracking device health and security policy enforcement. With the HP Touch-point Manager app, IT can quickly address risks to keep devices functional, and employees productive.6</p><p><br></p><p><b>Customized protection</b></p><p>HP BIOSphere boosts security and keeps mission-critical data and systems under lock and key with customizable authentication and BIOS-level passwords.</p><p><br></p><p><b>Storage options</b></p><p>Optimize your storage with latest high-performing storage options from HP.</p><p><br></p><p><b>Connected in every corner</b></p><p>Gain fast, reliable wireless with built-in Wi-Fi and Bluetooth® wireless technology.6</p></div>', '', '<p>Laptop and Charger</p>', '<p><b>Product Description</b><span xss=removed> </span>                        -                HP ProBook 450 G3 - 15.6\" - Core i3 6100U</p><p><b>Product Type</b>                                         -                Notebook</p><p><b>Operating System</b><span xss=removed> </span>                        -                 Win 7 Pro 64-bit (downgrade from Windows 10 Pro 64-bit) + Windows 10 Pro 64-bit Licence</p><p><b>Processor</b><span xss=removed> </span>                                        -                 Intel Core i3 (6th Gen) 6100U / 2.3 GHz / 3 MB Cache</p><p><b>Memory</b>                                                 -                 4 GB DDR4 (1 x 4 GB)</p><p><b>Storage<span xss=removed> </span></b>                                                -                 500GB HDD / 7200 RPM</p><p><b>Optical Drive<span xss=removed> </span></b>                                -                 DVD SuperMulti</p><p><b>Display</b><span xss=removed> </span>                                                -                 15.6\" LED backlight 1366 x 768 / HD</p><p><b>Graphics</b><span xss=removed> </span>                                        -                  Intel HD Graphics 520</p><p><b>Numeric Keypad</b><span xss=removed> </span>                                -                  Yes</p><p><b>Integrated Webcam</b><span xss=removed> </span>                        -                  Yes</p><p><b>Networking</b><span xss=removed> </span>                                        -                  Bluetooth 4.0, 802.11a/b/g/n/ac, Gigabit Ethernet</p><p><b>Battery</b><span xss=removed> </span>                                                -                  4-cell</p><p><b>Security</b><span xss=removed> </span>                                                -                  Trusted Platform Module (TPM) Security Chip, fingerprint reader</p>', '', '[\"silver\"]', 'metal', '37.8 cm x 26.43 cm x 2.48 cm', '3', '{\"Colour\":\"silver\"}', 0, '<p>One Year Warranty </p>', '[\"Replacement by vendor\"]', 'Plot 530A Aina Akingbala Street, Omole Phase 2 Estate, Ikeja Lagos&nbsp;', '[]', 'approved', 0, 12, '2019-03-14 11:17:13'),
