(45, 8, 14, '46537912', 'Infinix HOT 6 X606C', 'Infinix', 'HOT 6 X606C', 'gold', '<div class=\"prod_description\"><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552634473/onitshamarket/product/description/wodi7clsgmtq4tavl7gi.jpg\"><br></p><p>If you want to experience the best of innovation in smartphones on a budget, then the Infinix Hot 6 is what you have been looking for. It is powered by a high-end processor, which clocks a CPU frequency of 1.3GHz, thereby giving you the speed and efficiency you so desire. You also switch between multiple applications easily because of its 1GB RAM.<br></p></div>', '', '', '<p>Memory : 16gb Rom+2gbRam. </p><p>Display :6.0 infinity display. </p><p>Camera :dual camera+flash. </p><p>Battery :4000mah. </p><p>3G Network. </p><p>Facebook. </p><p><br></p>', '', '[]', '', '160.43 x 76.21 x 8.60mm', '0.158', '{\"Sim-Type\":\"dual sim\",\"OS-Type\":\"android os\",\"Battery-Capacity\":\"4000mah\",\"Internal-Memory\":\"32 gb\",\"RAM\":\"3 gb\"}', 0, '', '[]', '', '[]', 'approved', 0, 8, '2019-03-15 07:42:44'),
