(47, 8, 14, '86342179', 'Infinix Note 5 Stylus X605', 'Infinix', 'Note 5 Stylus X605', '', '<div class=\"prod_description\"><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552638140/onitshamarket/product/description/y0sspmlpdonbbbwlrjpe.jpg\"><br></p><p>If you are an Infinix fan well we have good news for you, Infinix is out with another smartphone in its Note series. The newly released Infinix Note 5 Stylus is a metal clad mid-range smartphone. While it offers a decent camera and displays with internals that are not really quite the powerful type. The smartphone come with addition AI for a better experience.<br></p></div>', '', '', '<ul><li>6.0-inch, IPS LCD capacitive touchscreen, 2160 X 1080 pixels</li><li>Android One</li><li>Octa-core MediaTek Helio P23 CPU with 4GB RAM</li><li>32GB built-in storage space, up to 128GB with a memory card</li><li>16MP Rear Camera and 16MP Front Camera</li><li>4G LTE</li><li>Fingerprint scanner (rear)</li><li>Stylus Pen (XPen)</li><li>Full Metal Body</li><li>4, 000mAh non removable Li-ion battery</li></ul>', '', '[]', '', '158 x 75 x 8.4 mm (6.22 x 2.95 x 0.33 in)', '0.5', '{\"Sim-Type\":\"dual sim\",\"OS-Type\":\"android os\",\"Battery-Capacity\":\"3000mah - 5000mah\",\"Internal-Memory\":\"64 gb\",\"RAM\":\"4 gb\",\"Sceen-Size\":\"5 inches\"}', 0, '<p>CARLCARE SERVICE CENTER</p><p><br></p>', '[\"Service Center\"]', '', '[]', 'approved', 0, 12, '2019-03-15 08:31:09'),
(48, 7, 53, '82914536', 'HP EliteBook 840 G3 Notebook PC', 'Hp', 'EliteBook 840 G3', 'silver', '<div class=\"prod_description\"><p><b>Processor family                                 -                    </b>6th Generation Intel® Core™ i7 processor</p><p><b>Processor technology                        -                    </b>Intel® Core™ i7 with vPro™ technology</p><p><b>Chipset                                                 -                    </b>Chipset is integrated with processor</p><p><b>Environmental                                    -                     </b>Low halogen 21 </p><p><br></p><p><b>MEMORY</b></p><p><b>RAM                                                      -                      </b>8GB DDR4-2133 SDRAM (1 x 8 GB)</p><p>(Transfer rates up to 2133 MT/s.)</p><p><b>Memory Slots                                      -                       </b>2 SODIMM</p><p><br></p><p><b>STORAGE</b></p><p><b>Internal drive                                       -                        </b>256 GB M.2 SATA SED SSD</p><p><br></p><p><b>DISPLAY AND GRAPICS</b></p><p><b>Display                                                   -                      </b>35.56 cm (14\") diagonal FHD SVA anti-glare slim LED-backlit (1920 x 1080)</p><p><b>GRAPICS                     </b></p><p><b>Integrated:                                             -                      </b>Intel® HD Graphics 520</p><p><b>Battery type                                           -                      </b>HP Long Life 3-cell, 46 WHr Li-ion polymer</p><p><b>Battery life Backup                                -                      </b>Up to 13 hours and 30 minutes</p></div>', '', '<p>Plot 530A Aina Akingbala Street, Omole Phase 2 Estate, Ikeja Lagos</p>', '<p>HP 840 G3 6th Generation Intel® Core™ i7 processor 8 GB DDR4-256 GB(14\")1 USB 3.0 1 DisplayPort 1 headphone/microphone combo 1 AC power 1 docking connector 1 RJ-45.</p><p>Impressively thin and light, the HP EliteBook 840 empowers users to create, connect, and collaborate, using enterprise-class performance technology that helps keep you productive in and out of the office.</p><p><br></p><p><b>Portable powerhouse</b></p><p>Combine high performance technology and long battery life with Windows 10 Pro,1 6th Gen Intel® Core™ processors,2 and a PCIe Gen3 SSD.3 Drive performance with DDR4 memory, and dual storage options3 for your most demanding business applications and fast access to data.</p><p><br></p><p><b>Slim new design with all the right ports</b></p><p>Connect to essential ports without the hassle of dongles. At just 18.9 mm, the ultraslim and light HP EliteBook 840 comes with VGA, Display Port, RJ-45, USB, USB-C™, and enterprise docking capabilities.</p><p><br></p><p><b>Strong security, powerful manageability</b></p><p>Protect, detect, and recover from malicious attacks with HP Sure Start with Dynamic Protection - the industry’s first self-healing BIOS that monitors and corrects BIOS corruption every 15 minutes.</p><p><br></p><p><b>Designed for collaboration</b></p><p>Replace your speaker phone with the HP EliteBook 840 with Audio by Bang & Olufsen plus HP Noise Reduction Software that provides a rich collaboration experience for applications like Skype for Business.3</p><p><br></p><p><b>Let nothing stand in your way</b></p><p>Power through your day with Windows 10 Pro1 and the powerful, sleek, thin, and light HP EliteBook 840.</p><p><br></p><p><b>Self-healing safeguard</b></p><p>HP Sure Start with Dynamic Protection checks your BIOS every 15 minutes to detect attacks and corruption then self-heals the BIOS automatically.</p><p><b><br></b></p><p><b>Give your fingers a break</b></p><p>Enjoy a remarkable balance of comfort and feedback with the HP Premium Keyboard engineered for accuracy.</p><p><br></p><p><b>Storage options galore</b></p><p>Get the speed and space you need without having to use external storage. Dual drive support options quickly boot, wake, and run your system on a fast SSD3 and let you maintain access to your files with a high-capacity HDD.3</p><p><br></p><p><b>Field ready</b></p><p>Stand up to the workload with an EliteBook that passed MIL-STD 810G testing.4</p><p><br></p><p><b>In-house serviceability</b></p><p>Expand your system’s memory, battery, storage, and WWAN components.5</p><p><br></p><p><b>Impressive sound</b></p><p>Experience the difference with HP Clear Sound AMP and the HP EliteBook 840 speakers.</p><p><br></p><p><b>Cut out the chatter</b></p><p>Suppress background noise including keyboard clicks with HP Noise Reduction Software.</p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"silver\"]', 'metal', '33.8 x 23.7 x 1.89 cm (non-touch); 33.8 x 23.7 x 2.02 cm (touch)', 'Starting at 1.48 kg (non-touch); Starting at 1.7 kg (touch)', '[]', 0, '<p>One Year Warranty</p>', '[\"replacement by vendor\"]', '', '[]', 'approved', 0, 14, '2019-03-15 13:59:43'),
