ccessory</b><span xss=removed> </span>                                         -             Web Camera, AC Adapter, Stereo speakers built-in, Microphone</p><p><b>Installed Operating System</b><span xss=removed> </span>                         -             Windows 10 Home</p><p><b>Width</b><span xss=removed> </span>                                                                 -             380 mm</p><p><b>Depth</b><span xss=removed> </span>                                                                 -             253.8 mm</p><p><b>Height</b><span xss=removed> </span>                                                                 -             23.8 mm</p></div>', '', '<p>Laptop and factory fitted Charger</p>', '<p>Get connected with the value-priced HP 250 UMA i3-7020U 250 G6 / 15.6 HD SVA AG / 4GB 1D DDR4 / 500GB/ DOS2.0 Notebook PC. Complete business tasks with Intel® technology, essential collaboration tools. The durable chassis helps protect the notebook from the rigors of the day.</p><p><br></p><p><b>Durable mobile design</b></p><p>Rest assured that the <b>HP 250 G6</b> can keep up with assignments on the run. The durable chassis protects the notebook so it looks as professional as you do.</p><p><br></p><p><b>Extras that polish the experience</b></p><p>HP, a world leader in PCs helps equip you with a fully functional notebook ready to connect to all your peripherals and designed to fit the needs of a business with an RJ-45 port and a VGA port.</p><p><br></p><p><b>Excellent entertainment</b></p><p>The optional DVD Writer Drive5 allows you to watch DVDs and create backups of your most important data.</p><p><br></p><p><b>Be your best virtual self</b></p><p>Sometimes in life, only a face-to-face conversation will do. Thanks to the HP’s optional HD Webcam with wide dynamic range (WDR) you always come off looking your best in bright and low light conditions6.</p><p><br></p><p><b>Cut out the chatter</b></p><p>Suppress background noise including keyboard clicks with HP Noise Cancellation Software.</p><p><br></p><p><b>All the right ports and slots</b></p><p>Quickly connect to your peripherals in the office or at home with legacy ports like an RJ-45 and a VGA port. Backup and quickly move data to and from your HP 250 with the fast and convenient SD card slot.</p><p><br></p><p><b>Help Secure Critical Data</b></p><p>The firmware Trusted Platform Module (TPM) provides hardware-based encryption keys to help secure your data, e-mail, and user credentials.</p><p><br></p><p><b>Hassle-Free Connectivity</b></p><p>Get fast connections with Gigabit LAN and WLAN 802.11ac/Bluetooth® 4.2 combo.</p><p><br></p><p><b>Storage Options Galore</b></p><p>Get the speed and space you need without having to use external storage. Dual drive support options quickly boot, wake, and run your system on a fast SSD and let you maintain access to your files with a high-capacity HDD.</p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"black\"]', 'synthetic', '', '1.86 kg', '{\"Colour\":\"black\"}', 0, '<p>One Year Warranty    </p>', '[\"Replacement by vendor\"]', '<p>Plot 530A Aina Akingbala Street, Omole Phase 2 Estate, Ikeja Lagos</p>', '[]', 'approved', 0, 20, '2019-03-17 18:06:00'),
(59, 8, 14, '37289165', 'Infinix X604 Note 5 GRAY', 'Infinix', 'X604 Note 5 GRAY', '', '<div class=\"prod_description\"><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552910581/onitshamarket/product/description/uh2jidf5zshwsxytq3ra.png\"><br></p><p>If you want a visual experience across extreme lighting conditions while saving battery power consumption by half, then look no further our Infinix X604 Note 5 GRAY (32+3) is product you need.</p><div><br></div></div>', '', '', '<ul><li>6.0 Inch HD Display</li><li>32 GB Storage, MicroSD up to 128 GB</li><li>12 MP Back Camera, 16 MP Front Camera</li><li>3 GB RAM, Quad-core 1.4 GHz CPU</li><li>Android OS</li><li>Li-Ion 4500mAh Battery</li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[]', '', '158 x 75 x 8.4 mm', '0.5', '{\"Sim-Type\":\"dual nano sim\",\"OS-Type\":\"android os\",\"Battery-Capacity\":\"3000mah - 5000mah\",\"Internal-Memory\":\"32 gb\",\"RAM\":\"3 gb\",\"Sceen-Size\":\"6 inches\"}', 0, '<p>1 Year Warranty</p>', '[\"Service Center\"]', '', '[]', 'approved', 0, 14, '2019-03-18 12:14:20'),
(60, 7, 53, '78543629', 'HP PB640G4 i5-8250U 8th GEN, 14INCHS, 4GB/500 PC ,DDRA SATA', 'Hp', 'ProBook 640 G4', 'silver', '<div class=\"prod_description\"><p><b>Operating System                        -            </b>Windows 10 Pro</p><p><b>Processor                                       -             </b><span xss=removed>Intel® Core™ i5-8250U with Intel® UHD Graphics 620 (1.6 GHz base frequency, up to 3.4 GHz with Intel® Turbo Boost                                                               Technology, 6 MB cache, 4 cores)</span></p><p><b>RAM                                                -             </b>4GB </p><p><b>Internal Storage                            -             </b>500GB</p><p><b>Display                                            -             </b>14\" diagonal HD</p><p><b>Graphics                                          -             </b>Intel® HD Graphics 620</p><p><b>Memory Slots                                 -             </b>2 SODIMM</p><p><b>Energy Efficiency                            -             </b>ENERGY STAR® certified and EPEAT® Gold registered configurations available </p><p><b>Battery type                                     -             </b>HP Long Life 3-cell, 48 Wh Li-ion</p><p><b>Camera                                             -             </b>720p HD camera</p><p><b>Audio                                                -              </b>HD audio, dual speakers, dual array microphone</p><p><b>Battery life Backup                         -             </b>Up to 13 hours and 45 minutes 33 </p><p><br></p><p><b>PORTS</b></p><p>1 USB 3.1 Type-C™ (charging)</p><p>3 USB 3.1 Gen 1 (1 charging)</p><p>1 HDMI 1.4</p><p>1 RJ-45</p><p>1 VGA</p><p>1 headphone/microphone combo</p><p>1 AC power</p><p>1 docking connector</p></div>', '', '<p>Laptop and Factory Fitted Charger </p>', '<p>The new modern ultra-slim design of the HP ProBook 640 delivers enterprise-grade performance, security, manageability, and flexible configuration options.</p><p><span xss=removed>Updated ultra-slim design</span></p><p><span xss=removed><br></span></p><p>The precision-crafted ultra-slim chassis in a modern natural silver finish is designed to pass MIL-STD 810G testing2 and supports several HP docking options3 for gradual transitions to modern docking solutions.</p><p><br></p><p><span xss=removed>High performance</span></p><p>Help speed up demanding business applications with an optional 8th Gen quad-core Intel® Core™ processor5 and discrete graphics.</p><p><br></p><p><span xss=removed>Built on a secure foundation</span></p><p>Protect your PC against the evolving malware threats of the future, with self-healing, hardware-enforced, and manageable security solutions from HP. From the BIOS to the browser HP Sure Start Gen46 and HP Sure Click7 help secure your PC.</p><p><br></p><p><span xss=removed>FEATURING</span></p><p><span xss=removed>Let nothing stand in your way</span></p><p>Power through your day with Windows 10 Pro1 and the powerful security, collaboration and connectivity features from HP.</p><p><br></p><p><span xss=removed>Powering your creativity</span></p><p>Take on demanding graphics and video tasks using high resolution 4k displays with optional AMD Radeon™ RX540 Discrete Graphics8.</p><p><br></p><p><span xss=removed>Preserve your privacy</span></p><p>Never wonder if someone is watching you with the added peace-of-mind that comes from the integrated HP Privacy Camera9, with a physical shutter to protect from malicious surveillance.</p><p><br></p><p><span xss=removed>Firmware Level Protection</span></p><p>Protect the firmware that antivirus can’t reach! The hardware-enforced self-healing protection offered by HP Sure Start Gen46 automatically recovers the BIOS from malware, rootkits, or corruption.</p><p><span xss=removed><br></span></p><p><span xss=removed>Protect identities with HP Multi-Factor Authenticate Gen2[11]</span></p><p>Fortify your security with up to three authentication factors including passwords and optional fingerprint recognition11.</p><p><br></p><p><span xss=removed>Browse confidently</span></p><p>Help protect your PC from websites and in-browser .pdf files infected with malware, ransomware, or viruses with HP Sure Click7.</p><p><br></p><p><span xss=removed>Speed up the basics of IT management</span></p><p>The HP Manageability Integration Kit Gen212 helps speed up image creation and management of hardware, BIOS, and security through Microsoft System Center Configuration Manager.</p><p><br></p><p><span xss=removed>Field ready</span></p><p>Stand up to the workload with a ProBook that is designed to pass MIL-STD 810G testing2.</p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"silver\"]', 'synthetic', '34 x 24 x 2.09 cm', '1.73 kg (Weight will vary by configuration.)', '{\"Battery-Life\":\"upto 13hrs\",\"Colour\":\"silver\"}', 0, '<p>One Year Warranty    </p>', '[\"Replacement by vendor\"]', '<p>Plot 530A AIna Akingbala Street, Omole Phase 2 Estate, Ikeja Lagos</p>', '[]', 'approved', 0, 14, '2019-03-18 12:21:10'),
(61, 8, 14, '26587934', 'TECNO KA7O', 'Tecno', 'KA7O', '', '<div class=\"prod_description\"><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552911968/onitshamarket/product/description/ryeeuc06icohyo2rxsa1.jpg\" xss=removed><br></p><p>Wouldn\'t it be great to have the TECNO KA7O that has SPARK 2 which collects 128 recognition points on your face and can identity you immediately and access your phone via the face unlock securely and speedily? Well, that hows awesome TECNO KA7O is, it reads your face and identifies who you are. This carefully design delivers speed and power, for any time and anywhere.</p></div>', '', '', '<ul><li>6.0-inch IPS HD+ Full Screen</li><li>16 GB Storage, MicroSD up to 32GB</li><li>13MP Back Camera, 8MP Front Camera</li><li>Quad-core 1.3 GHz CPU, 2GB RAM</li><li>Android OS, v8.1 (Oreo)</li><li>Li-Po 3500mAh battery, Fingerprint Sensor</li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"black\"]', '', '159.4 x 76.2 x 7.8 mm', '0.145', '{\"Sim-Type\":\"dual nano sim\",\"OS-Type\":\"android os\",\"Battery-Capacity\":\"3000mah - 5000mah\",\"RAM\":\"2 gb\",\"Sceen-Size\":\"6 inches\",\"Colour\":\"black\"}', 0, '', '[]', '', '[]', 'approved', 0, 16, '2019-03-18 12:40:53'),
(62, 8, 14, '16485397', 'SAMSUNG A6+', 'Samsung', 'A6+', 'black', '<div class=\"prod_description\"><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1552913970/onitshamarket/product/description/urc1o6ygbjajwpf234gc.png\" xss=removed><br></p><p>If you want to enjoy an immersive and uninterrupted experience then the Samsung Galaxy A6+ with its expansive, near bezel-less sAMOLED display that features vivid resolution and stunning contrast ratio is the phone for you.  </p><p>With it you can add clarity to what you capture, thanks to its features three-level front flash adjustment to avoid image degradation and glare when shooting selfies day and night.</p></div>', '', '', '<ul><li>4G LTE</li><li>3GB RAM</li><li>32GB ROM</li><li>Dual 16MP + 5MP rear camera and a 24MP front camera</li><li>Octa Core</li><li>Fingerprint sensor</li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"black\"]', '', '160.2 x 75.7 x 7.9mm', '0.191', '{\"Sim-Type\":\"dual nano sim\",\"OS-Type\":\"android os\",\"Battery-Capacity\":\"3000mah - 5000mah\",\"Internal-Memory\":\"64 gb\",\"RAM\":\"4 gb\",\"Sceen-Size\":\"6 inches\",\"Colour\":\"black\"}', 0, '<p>Samsung Warranty</p>', '[\"Service Center\"]', '', '[]', 'approved', 0, 20, '2019-03-18 13:12:04');
