(64, 7, 63, '27496518', 'HP 400G4PO AiO NT i58500T 4GB/1TB PC', 'Hp', 'HP 400G4PO', 'black', '<div class=\"prod_description\"><p><b>Operating system                         -         </b>FreeDOS 2.0</p><p><b>Processor family                            -        </b>8th Generation Intel® Core™ i5 processor</p><p><b>Processor                                        -         </b>Intel® Core™ i5-8500T with Intel® UHD Graphics 630 (2.1 GHz base frequency, up to 3.5 GHz with Intel® Turbo Boost Technology,                                                                      9 MB cache, 6 cores)</p><p><b>Chipset                                            -         </b>Intel® Q370</p><p><b>Form factor                                     -         </b>All-in-one</p><p><b>Management features                   -        </b>HP BIOS Config Utility (download)</p><p><b>HP Client Catalog (download)      -        </b>HP Driver Packs (download)</p><p><b>HP System Software Manager (download)      -     </b>Update BIOS via Cloud or Network (BIOS feature)</p><p><b>Ivanti Management Suite               -        </b>HP Management Integration Kit for Microsoft System Center Configuration Management Gen 2</p><p><b>Environmental                                  -        </b>Low halogen</p><p><b>Memory (RAM)                                 -        </b>4 GB DDR4-2666 SDRAM (1 X 4 GB)</p><p>(Transfer rates up to 2666 MT/s.)</p><p><b>Memory Slots                                    -         </b>2 SODIMM</p><p><b>Internal drive bays                            -       </b>  One 2.5\" HDD<b>                                   </b></p><p><b>Internal Drive                                     -         </b>1 TB 7200 rpm SATA</p><p><b>Additional storage                            -         </b>1 SD media card reader</p><p><b>Optical drive                                      -          </b>HP 9.5 mm Slim DVD-Writer</p><p><b>Display                                                -          </b>50.8 cm (20\") diagonal HD+ widescreen LCD anti-glare WLED-backlit (1600 x 900)</p><p><b>GRAPHICS      </b></p><p><b>Integrated                                           -           </b>Intel® UHD Graphics 630</p><p><b>Webcam                                              -           </b>1 MP HD webcam with integrated digital microphone, maximum resolution of 1280 x 720</p><p><b>EXPANSION FEATURES </b></p><p><b>Ports</b></p><p><b>Side:</b></p><p>1 headphone/microphone combo</p><p>1 USB 2.0 Type-C™</p><p>2 USB 3.1 Gen 1</p><p><b>Rear:</b></p><p>1 DisplayPort™ 1.2</p><p>1 power connector</p><p>1 RJ-45</p><p>2 USB 3.1 Gen 1</p><p><b>Optional:</b></p><p>1 HDMI 2.0 18 </p><p><b>Expansion slots</b></p><p>1 M.2 2230</p><p>1 M.2 2230/2280</p><p>(1 M.2 2230 slot for WLAN and 1 M.2 2230/2280 slot for storage.)</p><p><br></p><p><b>Media devices</b></p><p><b>Audio</b></p><p>Conexant CX3601 codec, 2 W internal stereo speaker, headset side port (3.5 mm), multi-streaming capable</p><p><b>Communications</b></p><p>Network interface</p><p>LANIntel® I219LM GbE</p><p>WLANIntel® Dual Band Wireless-AC 9560 802.11ac (2x2) and Bluetooth® 5 M.2, non-vPro™</p><p><br></p><p><b>Power and operating requirements</b></p><p><b>Power supply</b></p><p>90 W external power adapter</p><p>Operating temperature range</p><p>10 to 35°C</p><p>Operating humidity range</p><p>10 to 90% RH</p><p><br></p><p><b>Security management</b></p><p>DriveLock</p><p>Hood sensor</p><p>HP BIOSphere</p><p>HP Credential Manager</p><p>HP Password Manager</p><p>HP Power On Authentication</p><p>HP Security Manager</p><p>HP Spare Key</p><p>Intel® Identity Protection Technology (Intel® IPT)</p><p>Power-on password (via BIOS)</p><p>Removable media write/boot control</p><p>SATA port disablement (via BIOS)</p><p>Setup password (via BIOS)</p><p>Support for chassis padlocks and cable lock devices</p><p>Trusted Platform Module TPM 2.0 Embedded Security Chip (SLB9670 - Common Criteria EAL4+ Certified)</p><p>USB enable/disable (via BIOS)</p><p>Master Boot Record Security</p><p>HP Client Security Suite Gen 4</p><p>Pre-boot Authentication</p><p>Serial enable/disable (via BIOS)</p><p><br></p></div>', '', '<p>All in One Monitor and CPU, Mouse and Keyboard </p>', '<p>HP 400G4PO AiO NT I58500T 4GB/1TB PC-(4NT81EA)|HP ProOne 400 G4 20-Inch Non-Touch All-In-One Business PC</p><p>Easy to deploy, sleek, and feature-rich, the HP ProOne 400 20? All-in-One PC features a contemporary design with business-class performance, collaboration, security, and manageability features.</p><p><b>Sleek, elegant design</b></p><p>Stylish design and clean lines makes this AiO suitable for a front desk or an open office for space-constrained work environments.</p><p><b>Powerful options</b></p><p>Get high-performance and expansion with 8th gen Intel® Core™ processors2 and optional features like Intel® Optane™ memory3, discrete graphics4, USB Type-C™, and a configurable I/O port5.</p><p><b>Executive-class collaboration</b></p><p>Interact naturally with your PC using Cortana on Windows 10 Pro.1 Enjoy impressive collaboration tools like HP Noise Cancellation and optional Skype for Business</p><p><b>Let nothing stand in your way</b></p><p>Be productive in any situation. Windows 10 Pro and powerful security, collaboration, and connectivity features from HP help you power through your day.</p><p><b>Super secure. Super protected</b></p><p>Guard your data, device and identity with HP Client Security Manager Gen4.</p><p><b>Browse confidently</b></p><p>Help protect your PC from websites, attachments, malware, ransomware, and viruses with hardware-enforced security from HP Sure Click.</p><p><b>Speed up the basics of IT management</b></p><p>The HP Manageability Integration Kit Gen2 helps speed up image creation and management of hardware, BIOS, and security through Microsoft System Center Configuration Manager.</p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"black\"]', 'synthetic', '48.91 x 20.85 x 36.67 cm', '5.77 kg  (Lowest weight configuration with adjustable height stand. Weight will vary by configuration.)', '[]', 0, '<p>One Year Warranty</p>', '[\"Replacement by vendor\"]', 'Plot 530A Aina Akingbala Street, Omole Phase 2 Estate, Ikeja Lagos', '[]', 'approved', 0, 10, '2019-03-18 15:12:14'),
