(79, 18, 63, '39621548', 'generic Afresh AF2102P85 All-in-one Computer - Silver', 'others', 'Afresh AF2102P85 All-in-one Computer', 'silver', '<div class=\"prod_description\"><p>Afresh AF2102P85 All-in-one Computer</p><p>Watch movies, edit your lovely photos and view documents easily with this high-performance all-in-one computer, which features a gorgeous 18.5 inch FHD display. Powerful Intel processor, superfast graphics, huge hard disk storage and more, all of this can maximize your complete personal entertainment and work.</p><p><br></p><p>Main Features:</p><p>? CPU: Intel Core i3-330M 2.13GHz, equipped with better performance, delivering plenty of power for multitasking </p><p>? Graphics: Integrated Graphics with Radeon HD 8330, better and faster in playing games and watching videos </p><p>? Offers you a high-impact gaming experience, ensures faster Internet speed and smooth operation. </p><p>? Display: 18.5 inch IPS Screen</p><p>The 1366 x 768 resolution with 16:9 display ratio offers good experience for watching videos and browsing the Web</p><p>? HDMI Output: </p><p>Supports 2K output, can connect to high-definition monitor or projector</p><p><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1553009027/onitshamarket/product/description/mvpqryczdekk8ohimqdp.jpg\"><br></p><p><br></p></div>', '', '<p><span xss=removed>Computer: 1 </span><br xss=removed><span xss=removed>Mouse: 1 </span><br xss=removed><span xss=removed>Keyboard: 1</span><br></p>', '<p>Model: AF2102P85 </p><p>OS: Windows 7 </p><p>CPU Brand: Intel </p><p>CPU Series: Intel Core </p><p>Core: Dual Core </p><p>Caching: 3MB </p><p>Graphics Type: Integrated Graphics </p><p>Process Technology: 32nm </p><p>Threading: 4 </p><p>Power Consumption: 35W</p><p>RAM: 4GB </p><p>RAM Type: DDR3 </p><p>RAM Slot Quantity: One </p><p>Hard Disk Memory: 120GB</p><p>Screen size: 18.5 inch </p><p>Display Ratio: 16:9 </p><p>Screen type: IPS</p><p>Camera type: Single camera </p><p>Front camera: 1.3MP</p><p>