(81, 7, 63, '85726143', 'HP 440 G4PO AiO NT i58500T 4GB/1TB PC', 'Hp', 'HP 440 G4', 'black', '<div class=\"prod_description\"><p>Easy to deploy, sleek, and feature-rich, the HP ProOne 440 23.8\" All-in-One PC features a contemporary design with business-class performance, collaboration, security, and manageability features.<br></p><p><b>Sleek, elegant design</b></p><p>Stylish design, a micro-edge anti-glare display, and clean lines makes this AiO suitable for a front desk or space-constrained work environments.</p><p><br></p><p><b>Powerful Options</b></p><p>Get high-performance and expansion with 8th Gen Intel® Core™ processors and optional features like Intel® Optane™ Memory, discrete graphics, USB Type-C™, and a configurable I/O port.</p><p><br></p><p><b>Executive-class collaboration</b></p><p>Interact naturally with your PC using Cortana on Windows 10 Pro. Enjoy impressive collaboration tools like HP Noise Cancellation, optional Skype for Business™, and an optional IR Camera.</p><p><br></p><p><b>HP Exclusive Security and Manageability</b></p><p>Help prevent data breaches and downtime with HP BIOSphere Gen48 and simplify management with HP Manageability Integration Kit Gen29.</p></div>', '', '<p>All-in-One Monitor, Keybord and Mouse</p>', '<p><b>Operating system               -          </b>FreeDOS 2.0</p><p><b>Processor Family                 -          </b>8th Generation Intel® Core™ i5 processor</p><p><b>Processor                              -          </b>Intel® Core™ i5-8500T with Intel® UHD Graphics 630 (2.1 GHz base frequency, up to 3.5 GHz with Intel® Turbo Boost Technology, 9 MB                                                              cache, 6 cores)</p><p><b>Chipset                                  -           </b>Intel® Q370</p><p><b>Memory, Standard              -           </b>4 GB DDR4-2666 SDRAM (1 X 4 GB)  (Transfer rates up to 2666 MT/s.)</p><p><b>Memory Slots                      -           </b>2 SODIMM</p><p><b>Internal Drive Bays         