(95, 7, 55, '14783592', 'Lenovo Notebook IP 320-15ISK I3 4G 1T 10H', 'Lenovo', 'Notebook IP', 'red', '<div class=\"prod_description\"><p>Featuring the latest low power consumption Intel processor that\'s optimized for web browsing, video streaming and multi-tasking on-the-go.</p><p>Featuring High Definition and anti-glare screen, you\'ll experience true visual clarity on the Notebook IP, whether streaming or browsing the web</p><p>Life is hectic, and the last thing you want to worry about is running out of battery. The Notebook IP offers over 8 hours of battery life-that\'s around 1.15x longer than last generation.</p><p>The Notebook IP comes equipped with a Type-C port for your convenience. It\'s compatible with your other charging devices, so you won\'t need to purchase extra cords or chargers</p><p>Featuring curved keys and an ergonomic layout, the keyboard on the Notebook IP was designed with your comfort in mind. Touch, click and zoom-you\'ll feel the difference.</p><p><br></p><p><b>Operating System:</b> Windows 10 Home 64-Bit English</p><p><b>Display:</b> 15.6 inch 1366 x 768 LED Backlight, HD Anti-Glare Display</p><p><b>Processor: </b>Intel Dual Core Celeron N3350 1.10GHz Processor (up to 2.40GHz, 2M Cache)</p><p><b>Memory: </b>4GB DDR4 </p><p><b>Hard Drive: </b>1TB</p><p><b>Optical Drive: </b>DVD-RW</p><p><b>Ports:</b> 1 X HDMI Port, 1 X DC-In Port, 1 X Ethernet Port?10/100Base-T Fast Ethernet?, 1 X Headphone/Microphone Jack, 1 X USB 2.0 Port, 1 X USB 3.0 Ports</p><p><b>Video:</b> Intel HD Graphics 500</p><p><b>Multimedia Card Slot: </b>4 In 1 Media Card Reader (MultiMediaCard/SD/SDHC/SDXC)</p><p><b>Wireless Connectivity:</b> Intel 802.11ac Wi-Fi, Bluetooth 4.1</p><p><b>Webcam:</b> Yes </p><p><b>Battery:</b> 30WHr Battery, 2-Cell </p></div>', '', '<p>1 Laptop and 1 Factory fitted Charger </p>', '<p><b>Brand Name                          -   </b><span xss=removed> </span>  Lenovo </p><p><b>Hardware Platform</b><span xss=removed> </span>         -        PC</p