(102, 7, 55, '47982361', 'Lenovo Ideapad 320-15IKB Core i7-8550U (4C, 1.8 / 4.0GHz, 4GB, 8GB) 1TB 10H, Onyx Black Color', 'Lenovo', 'Ideapad', 'onyx black', '<div class=\"prod_description\"><p>Everything about the Ideapad 320 is designed to simplify your life. It will handle any task with ease, thanks to powerful processing and discrete graphics options. Preloaded with Windows 10 Home, you\'ll have the personal assistance of Cortana, designed to help open apps and answer your questions — whether typed or spoken. From the new streamlined design to a cleaner desktop interface, you\'ll enjoy the simplicity that IdeaPad 320 offers. The biggest challenge you\'ll face is choosing your perfect.<br></p><p>Streamline Your Day With Windows 10</p><p>The IdeaPad 320 brings you Windows 10 Home, featuring a host of exciting new features. Want to find a local Indian restaurant, or need gift suggestions? Ask Cortana — your very own digital personal assistant. Cortana works with more than a thousand apps and services to ensure you\'ll always have the answers you need. Best of all, it works across all your Windows 10 devices to keep you organized.</p><p><br></p><p><b>Easy Access to Movies and More</b></p><p>The IdeaPad 320 comes equipped with a DVD Drive, so you will be able to watch and listen to the movies and music you already own and love.</p><p><br></p><p><b>Audio Clarity at any Volume</b></p><p>Featuring Dolby Audio-optimized speakers, the IdeaPad 320 delivers crystal-clear audio with minimal distortion at any volume. Stream your favorite playlist or video chat with family — you\'ll hear every detail.</p><p><br></p><p><b>Keep it Simple With Lenovo App Explorer</b></p><p>With Lenovo App Explorer, choose only the apps you want. It\'s a straightforward and secure way to personalize your computer, and an essential part of Lenovo\'s commitment to cleaner, safer PCs.</p><p><br></p><p><b>Redesigned Touchpad, for Improved Responsiveness</b></p><p>The IdeaPad 320 comes with a touchpad, 