cklit keyboard</b>        -           US standard</div><div><b>AC adapter                  -           </b>100-240V</div><div><br></div><div><div><b>Keyboard and Trackpad </b><b>Full-size backlit keyboard with</b></div><div>78 (U.S.) or 79 (ISO) keys, including 12 function keys and 4 arrow keys (inverted “T” arrangement)</div><div><br></div><div><b>Ambient light sensor</b></div><div>Multi-Touch trackpad for precise cursor control; supports inertial scrolling, pinch, rotate, swipe, three?finger swipe, four-finger swipe, tap, double-tap, and drag capabilities</div><div><br></div><div><div><b>ELECTRICAL AND OPERATING REQUIREMENTS</b></div><div><b>Line voltage</b>                    -     100–240V AC</div><div><b>Frequency</b>                        -    50Hz to 60Hz</div><div><b>Operating temperature </b>-    50° to 95° F (10° to 35° C)</div><div><b>Storage temperature</b>     -    ?13° to 113° F (?25° to 45° C)</div><div><b>Relative humidity</b>           -    0% to 90% noncondensing</div><div><b>Operating altitude</b>          -    tested up to 10,000 feet</div><div><br></div><div><div><b>VIDEO SUPPORT</b></div><div>Simultaneously supports full native resolution on the built-in display and up to 3840-by-2160 resolution at 60Hz on an external display, both at millions of colors</div><div><b>Thunderbolt digital video output</b></div><div>Native Mini DisplayPort output</div><div>VGA, HDMI, DVI, and dual-link DVI output using adapters (sold separately)</div></div><div><br></div><div><div><b>Battery and Power2</b></div><div>Up to 12 hours wireless web</div><div>Up to 12 hours iTunes movie playback</div><div>Up to 30 days of standby time</div><div>Built-in 54?watt?hour lithium?polymer battery</div><div>45W MagSafe 2 Power Adapter with cable management; MagSafe 2 power port</div></div></div></div></div>', 'CHARLESVILLE TECHNOLOGIES LTD', '[]', 'ceramics', '', '1.35kg', '[]', 0, '', '[]', '', '[]', 'approved', 0, 100, '2019-03-27 10:25:49'),
