(114, 7, 55, '87945123', 'Lenovo Yoga 310-11iap - Intel Celeron N3350 - 11.6-inch Hd Touch - 64GB, 4GB, Win 10, 2-in-1 Laptop, 10-hours Battery', 'Lenovo', 'Lenovo Yoga', 'black', '<div><br></div><div>The Lenovo Yoga 310 laptop is an essential multimode device with a 360° hinge and four usage modes, Yoga 310 laptop is the perfect, lightweight companion for users on the go. Boasting the latest processing power, bags of storage for all your media needs, and a HD webcam for crystal clear video calls, you’ll always be connected with family and friends.<br></div><div><br></div><div><div><b>USB Always-On Charging</b></div><div>Go unplugged with up to 6 hrs of battery life, or conveniently recharge your smart device, even when your laptop is off, with USB always-on charging.</div><div><img src=\"https://res.cloudinary.com/onitshamarket/image/upload/v1553849373/onitshamarket/product/description/lmuxo1dvmpq1mivabvp6.jpg\" xss=removed><br></div><div><b><br></b></div><div><b>Dolby Audio</b></div><div>This mini laptop also packs an audio punch with Dolby Audio. Enjoy all your media with crystal clear audio at any volume.</div></div><div><br></div><div><div><b>Lightweight With Maximum Flexibility</b></div><div>Take it anywhere and use it anyhow (Laptop mode or Tablet mode). The Yoga 310 laptop is the ultimate in mobility, connectivity, and technology rolled into one. Weighing just 1.35 kg and a mere 20.9 mm thin, this device is perfect for an on the go lifestyle and fits comfortably into your bag without weighing you down.</div></div>', '', 'Plot 530A Aina Akingbala Street, Omole Phase 2 Estate, Ikeja Lagos.', '<div><b>Processor</b>                        <b>-</b>            Intel Pentium N4200 processor ( 1.10GHz 1600MHz 2MB )</div><div><b>Operating System</b>         <b>-</b>            Windows 10 Home</div><div><b>Graphics</b><span xss=removed> </span>                  <b>-</b>            Integrated Intel® Graphics</div><div><b>Memory<span xss=removed> </span></b>            