(118, 7, 81, '68197532', 'Apple 45W Macbook Air Charger', 'Apple', 'Macbook Air Charger', 'white', '<div class=\"prod_description\"><p>Macbook 45W Charger Magsafe 2 </p><p>Macbook Air Charger Magsafe 45W - T shape </p><p> 45W Macbook Air Charger Magsafe  MagSafe Power Adapter for MacBook 45W </p><p><br></p><p>This 14.85V, 3.05A, 45 Watt adapter / charger is compatible with the below Apple models: </p><p><br></p><p><b>Compatible For: </b></p><p>MacBook Air (Mid 2012 - Early 2015) </p><p>MacBook Air (11-inch, Early 2015) </p><p>MacBook Air (13-inch, Early 2015) </p><p>MacBook Air (11-inch, Early 2014) </p><p>MacBook Air (13-inch, Early 2014) </p><p>MacBook Air (13-inch, Mid 2013) </p><p>MacBook Air (11-inch, Mid 2013) </p><p>MacBook Air (13-inch, Mid 2012) </p><p>MacBook Air (11-inch, Mid 2012) </p><p><br></p><p><b>Compatible Models: </b></p><p>MacBook Air 6,1 MD711xx/B MD712xx/B </p><p>MacBook Air 6,2 MD760xx/B MD761xx/B </p><p>MacBook Air 6,2 MD760xx/A MD761xx/A </p><p>MacBook Air 6,1 MD711xx/A MD712xx/A </p><p>MacBook Air 5,2 MD231xx/A MD232xx/A </p><p>MacBook Air 5,1 MD223xx/A MD224xx/A </p></div>', '', '<p>Macbook Air Charger</p>', '<p><b>Power </b>                            -        45 Watts Macbook Air Charger <br></p><p><b>Input Voltage Range</b>    -        AC 100V-240V, 1.5A (worldwide use) </p><p><b>Output Voltage</b>             -        DC 14.85V 3.05A </p><p><b>Connector Size</b>             -        Magsafe 2 5pin </p><p><b>Shape</b>                             -        \"T\" Shape Tip </p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"white\"]', '', '', '0.35kg', '[]', 0, '', '[]', '', '[]', 'approved', 0, 22, '2019-03-28 08:53:54'),
(119, 8, 14, '67123495', 'Apple IPhone X 64GB ROM 5.8 Inch IOS 11.0 M11 64-bit 12MP 4G Smartphone(White)', 'Apple', 'IPhone X', 'white', '<div class=\"prod_description\"><p>Super Retina in two sizes — including the largest display ever on an iPhone. Even faster Face ID. The smartest, most powerful chip in a smartphone. And a breakthrough dual-camera system with Depth Control. iPhone XS is everything you love about iPhone. Taken to the extreme.<br></p><p><br></p></div>', '', '<ul><li>1 x Phone</li><li>1 x Earphone</li><li>1 x User Manual</li></ul>', '<ul><li>Screen: 5.8\" OLED HD Retina Display</li><li>Memory: 3GB RAM+64GB ROM</li><li>CPU: A11 Bionic Chip with 64-bit architecture</li><li>Operating System: iOS 11</li><li>Camera: 12MP wide-angle and telephoto cameras, 7MP TrueDepth front camera</li><li>Battery: Up to 21 hours talk time</li><li>Support Face ID, Siri, NFC, wireless charge</li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[]', '', '14.36*7.09*0.77cm', '0.174', '{\"Sim-Type\":\"nano sim\",\"OS-Type\":\"ios\",\"Battery-Capacity\":\"1000mah - 3000mah\",\"Internal-Memory\":\"64 gb\",\"RAM\":\"3 gb\",\"Sceen-Size\":\"5.9 inches\",\"Colour\":\"white\"}', 0, '<p>1 Year Warranty</p><div><br></div>', '[\"Service Center\"]', '', '[]', 'approved', 0, 8, '2019-03-28 09:32:58'),
