x 28 x 7', '0.38kg', '[]', 0, '<p><br></p>', '[]', '', '[]', 'pending', 0, 8, '2019-03-28 09:40:21'),
(121, 8, 14, '57126948', 'Apple IPhone XS Max (4GB RAM, 256GB ROM) IOS 12 (12MP + 12MP)+7MP - 1 Year Warranty - Silver', 'Apple', 'IPhone XS Max (4GB RAM, 256GB ROM) IOS 12 (12MP + 12MP)+7MP - 1 Year Warranty - Silver', 'silver', '<div class=\"prod_description\"><p>Super Retina. In big and bigger. The custom OLED displays on iPhone XS deliver the most accurate color in the industry, HDR, and true blacks. And iPhone XS Max has our largest display ever on an iPhone.<br></p></div>', '', '<ul><li>Apple iPhone XS Max</li><li>EarPods with Lightning connector</li><li>Lightning to USB cable</li><li>USB power adapter</li><li>Documentation</li></ul>', '<ul><li>6.5-inch Super Retina display (OLED) with HDR</li><li>IP68 dust and water resistant (maximum depth of 2 meters up to 30 minutes)</li><li>12MP dual cameras with dual OIS and 7MP TrueDepth front camera – Portrait mode, Portrait Lighting, Depth Control, and Smart HDR</li><li>Face ID for secure authentication and Apple Pay</li><li>A12 Bionic with next-generation Neural Engine</li><li>Wireless charging – works with Qi chargers</li><li>iOS 12 with Memoji, Screen Time, Siri Shortcuts, and Group FaceTime</li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"silver\"]', '', '14.4 x 7.1 x 0.77cm', '177', '{\"Sim-Type\":\"nano sim\",\"OS-Type\":\"ios\",\"Battery-Capacity\":\"3000mah - 5000mah\",\"Internal-Memory\":\"256 gb\",\"RAM\":\"4 gb\",\"Sceen-Size\":\"6.4 inches\",\"Colour\":\"silver\"}', 0, '<p>1 Year</p>', '[\"Service Center\"]', '', '[]', 'approved', 0, 10, '2019-03-28 10:34:42'),
(122, 7, 58, '85742639', 'Apple MacBook Air - 13.3&quot; Retina Display - Intel Core I5 - 8GB Memory - 256GB SSD 2018 - Gold', 'Apple', 'MacBook Air', 'gold', '<div class=\"prod_description\"><p>The Retina Display has found its way onto the late 2018 gold Apple 13.3\" MacBook Air.</p><p><br></p><p>With over 4 million pixels, the 13.3\" Retina Display features a 2560 x 1600 screen resolution and a 16:10 aspect ratio for 227 pixels per inch (ppi). The display also features up to 48 percent more color than the previous generation. The display glass goes right to the edge of the screen for 50% less bezels.</p><p><br></p><p>The integrated Touch ID sensor allows you to unlock your MacBook Air with your fingerprint and authenticate your identity. You can also make secure online purchases with Apple Pay. Paired with the Apple T2 security chip, the T2\'s Security Enclave protects your Touch ID information and also ensures that software loaded during the boot process has not been tampered with. The T2 also features an SSD controller with on-the-fly data encryption for everything stored on the SSD for a secure boot process.</p><p><br></p><p>The keyboard utilizes Apple\'s butterfly mechanism for precise and responsive typing. Each key is individually backlit and works with an ambient light sensor for a more uniform illumination. You can also use the Force Touch trackpad, which is 20 percent larger than the previous generation, and has pressure-sensing capabilities as well as haptic feedback. The stereo speakers have also been improved to provide twice the bass and 25 percent more volume than the previous generation.</p><p><br></p><p>Featuring a significantly smaller footprint, the MacBook Air takes up 17 percent less volume, is 10 percent thinner measuring just 0.61 inches at its thickest point, and at just 2.75 pounds is a quarter pound lighter than the previous generation. Made from a custom Apple-designed aluminum alloy, the MacBook Air was created out of 100 percent recycled aluminum. This custom aluminum alloy helps reduce the MacBook Air\'s carbon footprint by nearly 50 percent.</p><p><br></p><p>The system is powered by an 8th Gen 1.6 GHz Intel Core i5 dual-core processor and has 8GB of onboard 2133 MHz LPDDR3 RAM and a 256GB PCIE-based SSD. Connect to the internet via Wi-Fi 5 (802.11ac) and use Bluetooth 4.2 to connect wirelessly to compatible peripherals and accessories. The dual Thunderbolt 3 ports provide high bandwidth of up to 40 Gb/s and the versatility of USB Type-C.</p><p><br></p><p><b>Features include:</b></p><p>VoiceOver</p><p>Zoom</p><p>Increase Contrast</p><p>Reduce Motion</p><p>Siri and Dictation</p><p>Switch Control</p><p>Closed Captions</p><p>Text to Speech</p><p>Built-in Apps4</p><p>Photos</p><p>iMovie</p><p>GarageBand</p><p>Pages</p><p>Numbers</p><p>Keynote</p><p>Siri</p><p>Safari</p><p>Mail</p><p>FaceTime</p><p>Messages</p><p>Maps</p><p>News</p><p>Stocks</p><p>Home</p><p>Voice Memos</p><p>Notes</p><p>Calendar</p><p>Contacts</p><p>Reminders</p><p>Photo Booth</p><p>Preview</p><p>iTunes</p><p>Books</p><p>App Store</p><p>Time Machine</p></div>', '', '<ol><li>MacBook Air</li><li>30W USB-C Power Adapter</li><li>USB-C Charge Cable (2 m)</li></ol>', '<p><b>CPU Speed </b><span xss=removed> </span>                      -          1.6 GHz </p><p><b>Processor Type</b><span xss=removed> </span>              -          Intel Core i5</p><p><b>Operating System</b><span xss=removed> </span>      -           Mac OS X</p><p><b>Camera</b>                                -           720p FaceTime HD camera</p><p><b>RAM</b>                                      -          8GB Onboard </p><p><b>Internal Storage </b>                 -         256GB SSD</p><p><b>Display</b>                                  -         13.3\" 2560 x 1600 Retina IPS Display</p><p><b>Graphics</b>                                -         Integrated Intel UHD Graphics 617</p><p><b>Wireless Network</b>                -         Wi-Fi 5 (802.11ac) - </p><p><b>Blootooth</b>                              -         Bluetooth 4.2</p><p><b>Sensor </b>                                   -         Integrated Touch ID Sensor</p><p><b>Audio</b>                                      -         Stereo speakers</p><p><b>Full-size keyboard with</b>       -         78 (U.S.) or 79 (ISO) individual LED-backlit keys, including 12 function keys and 4 arrow keys</p><p><br></p><p><b>Electrical and Operating Requirements</b></p><p><b>Line voltage</b>                     -        100–240V AC</p><p><b>Frequency</b>                         -        50Hz to 60Hz</p><p><b>Operating temperature</b>  -        50° to 95° F (10° to 35° C)</p><p><b>Storage temperature</b>      -         ?13° to 113° F (?25° to 45° C)</p><p><b>Relative Humidity</b>             -        0% to 90% noncondensing</p><p><b>Operating Altitude</b>           -        Tested up to 10,000 feet</p><p><br></p><p><b>Battery and Power2</b></p><p>Up to 12 hours wireless web</p><p>Up to 13 hours iTunes movie playback</p><p>Up to 30 days of standby time</p><p>Built-in 50.3?watt?hour lithium?polymer battery</p><p>30W USB-C Power Adapter; USB-C power port</p>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"gold\"]', 'glass', '', '3kg', '{\"Battery-Life\":\"upto 13hrs\"}', 0, '<p>One Year Warranty</p>', '[\"Replacement by vendor\"]', '<p>Plot 530A Aina Akingbala Street, Omole Phase 2 Estate, Ikeja Lagos.</p>', '[]', 'approved', 0, 6, '2019-03-28 11:21:00'),
(123, 8, 14, '56431927', 'Apple IPhone 8 Plus 5.5-Inch HD (3GB,64GB ROM) IOS 11, 12MP + 7MP 4G Smartphone - Red (+ 2 Year Warranty)', 'Apple', 'Apple IPhone 8 Plus', 'red', '<div class=\"prod_description\"><p>Splash, water, dust resistant and introducing an all?new glass design, 8 is an upgrade on the most famous features of the iPhone while adding a few new ones, creating the world\'s finest and smartest device. <br></p></div>', '', '', '<ul><li>Display: 5.5-inch Retina HD</li><li>CPU: Apple A11 Bionic Hexa-core</li><li>Memory: 3GB RAM; 64GB ROM</li><li>OS: Apple iOS 11 </li><li>Camera: 12MP; 7MP HD FaceTime</li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"red\"]', 'ceramics', '6.81 x 14.88 x 0.79 cm', '0.2', '{\"Sim-Type\":\"Nano SIM\",\"OS-Type\":\"iOS\",\"Battery-Capacity\":\"1000mAh - 3000mAh\",\"Internal-Memory\":\"64 GB\",\"RAM\":\"3 GB\",\"Sceen-Size\":\"5.5 inches\",\"Colour\":\"Red\"}', 1, '<p>2 Year Manufacturer<br></p>', '[\"Service Center\"]', '', '[]', 'approved', 0, 6, '2019-03-28 11:21:39'),
(124, 8, 14, '36514782', 'Apple IPhone X (3GB RAM, 256GB ROM) - Silver', 'Apple', 'IPhone X', 'silver', '<div class=\"prod_description\"><p>Finally, an iPhone that is all screen. The iPhone X delivers an immersive experience, allowing you to focus on your content. The intelligent iPhone X responds to a tap, your voice, and maybe even a glance. Say hello to the future. </p></div>', '', '<ul><li>iPhone with iOS 11</li><li>EarPods with Lightning Connector</li><li>Lightning to 3.5 mm Headphone Jack Adapter</li><li>Lightning to USB Cable</li><li>USB Power Adapter</li><li>Documentation</li></ul>', '<ul><li>Screen: 5.8\" OLED HD Retina Display</li><li>Memory: 3GB RAM ,256GB ROM</li><li>CPU: A11 Bionic Chip with 64-bit architecture</li><li>Operating System: iOS 11</li><li>Camera: 12MP wide-angle and telephoto cameras, 7MP TrueDepth front camera</li><li>Battery: Up to 21 hours talk time</li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"silver\"]', '', '143.6 x 70.9 x 7.7 mm', '0.177', '{\"Sim-Type\":\"nano sim\",\"OS-Type\":\"ios\",\"Battery-Capacity\":\"1000mah - 3000mah\",\"Internal-Memory\":\"256 gb\",\"RAM\":\"3 gb\",\"Sceen-Size\":\"5.88 inches\",\"Colour\":\"silver\"}', 0, '<p>1 year</p><div><br></div>', '[\"Service Center\"]', '', '[]', 'approved', 0, 10, '2019-03-28 11:59:40'),
(125, 7, 58, '25743961', 'Apple Macbook Air (13-Inch) 1.8GHz dual-core Intel Core i5, Turbo Boost up to 2.9GHz, with 3MB shared L3 cache, 256GB PCIe-based SSD', 'Apple', 'Macbook Air', 'grey', '<div class=\"prod_description\"><p>MacBook Air features up to 8GB of memory, a fifth-generation Intel Core processor, Thunderbolt 2, great built-in apps, and all-day battery life. It’s thin, light, and durable enough to take everywhere you go—and powerful enough to do everything once you get there.<br></p><p><br></p><p><b>Video Support And Camera</b><span xss=removed> </span></p><p>Dual display and video mirroring: Simultaneously supports full native resolution on the built-in display and up to 3840-by-2160 resolution at 60Hz on an external display, both at millions of colors. Thunderbolt digital video output       Native Mini DisplayPort output           DVI output using Mini DisplayPort to DVI Adapter (sold separately) VGA output using Mini DisplayPort to VGA Adapter (sold separately) Dual-link DVI output using Mini DisplayPort to Dual-Link DVI Adapter (sold separately) HDMI audio and video output using third-party Mini DisplayPort to HDMI Adapter (sold separately)   Camera     720p FaceTime HD camera</p></div>', '', '<p>Plot 530A Aina Akingbala Street, Omole phase 2 Estate, Ikeja Lagos.</p>', '<p><b>Mac Model<span xss=removed> </span></b>                -            MacBook Air</p><p><b>Screen Size<span xss=removed> </span></b>                -            13.3 Inch</p><p><b>Processor</b><span xss=removed> </span>                -            1.8GHz dual-core Intel Core i5, Turbo Boost up to 2.9GHz, with 3MB shared L3 cache</p><p><b>Memory<span xss=removed> </span></b>                        -            8GB of 1600MHz LPDDR3 onboard memory</p><p><b>Storage<span xss=removed> </span></b>                        -            256GB PCIe-based SSD</p><p><b>Graphics</b><span xss=removed> </span>?                -            Intel HD Graphics 6000</p><p><b>Wireless</b>             