(126, 8, 14, '13759628', 'Apple IPhone 7 Plus - 5.5-inch Retina - 128GB - Apple IOS 10 Smartphone - Red', 'Apple', 'IPhone 7 Plus', 'red', '<div class=\"prod_description\"><p>Apple iPhone 7 Plus smartphone was launched in September 2016. The phone comes with a 5.50-inch touchscreen display with a resolution of 1080x1920 pixels at a pixel density of 401 pixels per inch (ppi).</p><p><br></p><p>Apple iPhone 7 Plus is powered by a quad-core Apple A10 Fusion processor. It comes with different GB of RAM.</p><p><br></p><p>The Apple iPhone 7 Plus runs iOS 10 and is powered by a 2,900mAh non-removable battery.</p><p><br></p><p>As far as the cameras are concerned, the Apple iPhone 7 Plus on the rear packs 12-megapixel camera. It sports a 7-megapixel camera on the front for selfies.</p><p><br></p><p>Apple iPhone 7 Plus based on iOS 10 and packs 128GB of inbuilt storage. The Apple iPhone 7 Plus is a single SIM (GSM) smartphone that accepts a Nano-SIM card.</p><p><br></p><p>Connectivity options on the Apple iPhone 7 Plus include Wi-Fi 802.11 a/b/g/n/ac, GPS, Bluetooth v4.20, 3G, and 4G (with support for Band 40 used by some LTE networks in India). Sensors on the phone include accelerometer, ambient light sensor, barometer, gyroscope, proximity sensor, and compass/ magnetometer.</p><p><br></p><p>The Apple iPhone 7 Plus measures 158.20 x 77.90 x 7.30mm (height x width x thickness) and weighs 188.00 grams</p></div>', '', '', '<ul><li>Display: 5.5-inch Retina HD</li><li>CPU: Quad Core A10 Fusion chip with 64-bit architecture</li><li>Memory: 3GB RAM; 128GB ROM</li><li>OS: Apple iOS 10 </li><li>Camera: 12MP; 7MP HD FaceTime</li><li>Red</li><li><br></li></ul>', 'CHARLESVILLE TECHNOLOGIES LTD', '[\"black\",\"red\",\"silver\"]', '', '158.2 x 77.9 x 7.3 mm', '0.188', '{\"Sim-Type\":\"nano sim\",\"OS-Type\":\"ios\",\"Battery-Capacity\":\"1000mah - 3000mah\",\"Internal-Memory\":\"128 gb\",\"RAM\":\"3 gb\",\"Sceen-Size\":\"5.5 inches\",\"Colour\":\"red\"}', 0, '<p><span xss=removed> </span>1 Year Apple Warranty<br></p>', '[\"Service Center\"]', '', '[]', 'pending', 0, 6, '2019-03-28 13:00:43'),
(127, 7, 58, '48563912', 'Apple Macbook Air (13-Inch Diagonal) 2.3GHz dual-core Intel Core i5, Turbo Boost up to 3.6GHz, with 64MB of eDRAM', 'Apple', 'Macbook Air', 'grey', '<div class=\"prod_description\"><p>The MacBook Air features up to 8GB of 2133MHz LPDDR3 onboard memory, a fifth-generation Intel Core processor, Thunderbolt 2, great built-in apps, and all-day battery life. It’s thin, light, and durable enough to take everywhere you go—and powerful enough to do everything once you get there.<br></p></div>', '', '<p>Plot 530A Aina Akingbala Street, Omole phase 2 Estate, Ikeja Lagos.</p>', '<p><b>Device</b><span xss=removed> </span>                      -     Macbook Air</p><p><b>Processor<span xss=removed> </span></b>              -     2.3GHz dual-core Intel Core i5, Turbo Boost up to 3.6GHz, with 64MB of eDRAM</p><p><b>Screen Size (inches)  </b>-      13.3 Inch<br></p><p><b>Memory<span xss=removed> </span></b>                      -     8GB of 2133MHz LPDDR3 onboard memory</p><p><b>Storage</b><span xss=removed> </span>                      -     128GB PCIe-based onboard SSD</p><p><b>Graphics</b>                      -     Intel Iris Plus Graphics 640</p><p><span xss=removed>Wireless</span>  <span xss=removed>(Wi-Fi)</span>         -     802.11ac Wi-Fi wireless networking; IEEE 802.11a/b/g/n compatible   </p><p><span xss=removed>Bluetooth</span>                     -     4.2 wireless technology</p><p><b>Audio</b>                            -      Stereo speakers with high dynamic range Two microphones 3.5 mm headphone jack</p><p><b>Retina Display:</b></p><p>13.3-inch (diagonal) LED-backlit display with IPS technology; 2560-by-1600 native resolution at 227 pixels per inch with support for millions of colors.</p><p><b>Connections And Expansion:</b><span xss=removed> </span></p><p>Two Thunderbolt 3 (USB-C) ports with support for: Charging DisplayPort Thunderbolt (up to 40 Gbps)  USB 3.1 Gen 2 (up to 10 Gbps)</p><p><b>Power And Battery</b><span xss=removed> </span>